  "text" : "\uC606\uC9D1 \uB0A8\uC790\uB294 \uACE0\uC591\uC774\uB97C \uB300\uCCB4 \uBA87\uC2DC\uAC04\uC9F8 \uD63C\uB0B4\uACE0 \uC788\uB294\uAC70\uB0D0. \uBA87\uC2DC\uAC04\uC9F8 \uB9D0 \uBABB\uD558\uB294 \uACE0\uC591\uC774 \uB530\uB77C\uB2E4\uB2C8\uBA74\uC11C \"\uC798\uBABB\uD588\uC5B4 \uC548\uD588\uC5B4, \uC65C \uB9D0\uC744 \uBABB\uD574\" \uB77C\uACE0 \uC18C\uB9AC\uC9C0\uB974\uACE0 \uC788\uB294 \uBCD1\uC2E0. \uACE0\uC591\uC774\uAC00 \uBB34\uB98E \uAFC7\uACE0 \"\uC8C4\uC1A1\uD569\uB2C8\uB2E4, \uC81C\uAC00 \uC0DD\uAC01\uC774 \uC9E7\uC558\uC2B5\uB2C8\uB2E4. \uC6A9\uC11C\uD574\uC8FC\uC138\uC694\"\uB77C\uACE0 \uD574\uC57C \uADF8\uB9CC\uD560\uB798??",
