  "text" : "\uBB50 \uADF8\uB0E5 \uADF8\uB807\uC2B5\uB2C8\uB2E4. \uC81C \uC8FC\uBCC0\uC5D0\uB294 \uB9CE\uC9C0\uB294 \uC54A\uC9C0\uB9CC.. \uD574\uACE0\uAC00 \uB418\uC5B4\uB3C4 \uC790\uC0B4\uC774\uB77C\uB294 \uADF9\uB2E8\uC801 \uBC29\uBC95\uC744 \uC120\uD0DD\uD558\uC9C0 \uC54A\uACE0 \uAFCB\uAFCB\uD558\uAC8C \uC0C8\uCD9C\uBC1C \uD558\uC2E0 \uBD84\uB4E4\uB9CC \uACC4\uC154\uC11C \uADF8\uB7F0\uC9C0\uB294 \uBAB0\uB77C\uB3C4, '\uD574\uACE0\uB294 \uC0B4\uC778\uC774\uB2E4! \uD574\uACE0\uB178\uB3D9\uC790\uC758 \uC790\uC0B4\uC5D0 \uCC45\uC784\uC838\uB77C'\uB77C\uB294 \uB9C8\uC778\uB4DC\uC5D0 \uB3D9\uC870\uD558\uAE30\uAC00 \uC369 \uC27D\uC9C0\uB294 \uC54A\uB124\uC694.",
