  "text" : "\uAC19\uC740 \uC758\uBBF8\uB85C- \uBC15\uADFC\uD61C\uAC00 \uB300\uD1B5\uB839\uC5D0 \uB2F9\uC120\uB41C \uC774\uD6C4, \uC790\uC0B4\uD55C \uD574\uACE0\uB178\uB3D9\uC790\uB4E4\uC758 \uC8FD\uC74C\uC5D0 \uB300\uD55C \uCC45\uC784\uC744 \uBC15\uADFC\uD61C\uC5D0\uAC8C \uB5A0\uB118\uAE30\uB824\uB294 \uC2DC\uB3C4\uB294 \uC194\uC9C1\uD788 \uB9D0\uD574 \uC880 \uBE44\uC5F4\uD55C \uC815\uCE58\uC801 \uACF5\uC138\uC600\uB2E4\uACE0 \uC0DD\uAC01. \uC544\uC9C1 \uB300\uD1B5\uB839\uB3C4 \uC544\uB2CC \uBC15\uADFC\uD61C\uAC00 \uD574\uACE0\uB41C \uB178\uB3D9\uC790\uC758 \uC790\uC0B4\uC5D0 \uB300\uD574 \uBB34\uC2A8 \uCC45\uC784\uC774 \uC788\uB098 \uAD81\uAE08..",
