  "text" : "\uD574\uACE0\uB41C \uB178\uB3D9\uC790\uB4E4\uC758 \uC790\uC0B4\uC740 \uBB3C\uB860 \uC548\uD0C0\uAE5D\uC9C0\uB9CC.. \uADF8\uB807\uB2E4\uACE0 \uC774\uB4E4\uC744 \uD574\uACE0\uD55C \uAE30\uC5C5\uC5D0\uAC8C \uBAA8\uB4E0 \uCC45\uC784\uC744 \uC804\uAC00\uD558\uB824 \uB4DC\uB294 \uB17C\uB9AC\uB294 \uCC38\uC73C\uB85C \uC704\uD5D8\uD55C \uBC1C\uC0C1\uC774\uB77C\uACE0 \uC0DD\uAC01\uD574\uC694. \uBD80\uB2F9\uD574\uACE0\uAC00 \uC544\uB2CC \uC774\uC0C1\uC740 \uC0AC\uC6A9\uC790\uAC00 \uC65C, \uADF8\uB9AC\uACE0 \uB300\uCCB4 \uC5B4\uB514\uAE4C\uC9C0 \uCC45\uC784\uC744 \uBB3C\uC5B4\uC57C \uD55C\uB2E4\uB294\uAC74\uC9C0..",
