  "text" : "\u2018\uACBD\uC601\uC0C1 \uC774\uC720\uC5D0 \uC758\uD55C \uD574\uACE0\u2019\uB77C\uB294 \uAE30\uC5C5\uACFC \uC0AC\uC6A9\uC790\uC758 \uC9C1\uC5C5\uC758 \uC790\uC720\uB77C\uB294 \uAE30\uBCF8\uAD8C\uC774 \/ \uADFC\uB85C\uC790\uC758 \uADFC\uB85C\uC758 \uAD8C\uB9AC\uC5D0 \uAE30\uBC18\uD55C \uADFC\uB85C\uAD00\uACC4 \uC874\uC18D \uBCF4\uD638\uAD8C\uBCF4\uB2E4 \uD558\uC704\uC758 \uAE30\uBCF8\uAD8C\uC774\uB77C\uACE0 \uBCFC \uC218\uB294 \uC5C6\uB294 \uBC14- \uBC95\uB839\uC5D0\uC11C \uADDC\uC81C\uD558\uB294 \uBD80\uB2F9\uD574\uACE0\uAC00 \uC544\uB2CC \uC774\uC0C1\uC740 \uAE30\uC5C5\uC5D0\uAC8C \uBB34\uD55C\uCC45\uC784\uC744 \uBB3C\uC744 \uC218\uB3C4 \uC5C6\uB294\uB370",
