  "text" : "\uD574\uB2F9 \uAE30\uC5C5\uC758 \uC7AC\uC815\uC0C1\uD0DC\uB77C\uB358\uAC00, \uD639\uC740 \uACBD\uC601\uC0C1 \uAF2D \uD544\uC694\uD55C \uC774\uC720\uC5D0 \uB530\uB978 \uD574\uACE0\uC600\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 '\uD574\uACE0\uB294 \uD53C\uC6A9\uC790\uC5D0 \uB300\uD55C \uC0B4\uC778\uC774\uC57C, \uC808\uB300\uB85C \uD574\uACE0\uD558\uBA74 \uC548\uB3FC' \uB77C\uACE0 \uC0DD\uAC01\uD558\uAE30 \uC2DC\uC791\uD558\uBA74 \uB2F5\uC774 \uC5C6\uB294 \uB4EF. \uB2D8\uB4E4\uB3C4 \uB2D8\uB4E4 \uC601\uC5C5\uC774 \uC5B4\uB824\uC6CC\uC9C0\uAC70\uB098 \uC9C1\uC6D0\uC774 \uC77C \uBABB\uD558\uBA74 \uBC14\uB85C \uC790\uB97C\uAEBC\uC796\uC544\uC694.",
