  "text" : "\uC800\uB3C4 \uADF8\uAC8C \uBBF8\uC548\uD574\uC11C \uC800\uB3C4 \uB2D8\uB4E4\uD55C\uD14C \uC5F0\uB77D \uC790\uC8FC \uD558\uB77C\uACE0 \uC73D\uBC15\uC9C0\uB974\uC9C0 \uC54A\uC796\uC544\uC694. \uB0B4\uAC00 \uC5F0\uB77D\uC744 \uBC1B\uC744 \uC218 \uC788\uB294 \uC0C1\uD669\uC774\uBA74 \uBC14\uB85C\uBC14\uB85C \uB2F5\uC744 \uC8FC\uB294\uAC70\uACE0, \uC0C1\uD669\uC774 \uC548\uB418\uBA74 \uC0C1\uD669\uC774 \uB420 \uB54C \uCC9C\uCC9C\uD788 \uB2F5\uC744 \uC8FC\uB294\uAC70\uC9C0.. \uB0B4\uAC00 24\uC2DC\uAC04 \uB0B4\uB0B4 \uC804\uD654\uAE30\uB97C \uBD99\uB4E4\uACE0 \uC0B4\uC544\uC57C \uD558\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0.",
