  "text" : "\uC65C \uC5F0\uB77D \uC790\uC8FC \uC548\uD558\uB0D0, \uC65C \uC18C\uC2DD\uC774 \uC5C6\uB0D0, \uC65C \uBA54\uC2DC\uC9C0\uB97C \uBC14\uB85C \uD655\uC778 \uC548\uD558\uB0D0 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0- \uD558\uB294 \uC18C\uB9AC \uB4E4\uC73C\uBA74 \uBBF8\uCE60 \uAC83 \uAC19\uB2E4. \uBB34\uC804\uAE30\uB85C \uC2E4\uC2DC\uAC04 \uD1B5\uC2E0\uC744 \uD574\uC57C \uD558\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0, \uBA54\uC2DC\uC9C0\uB97C \uB0A8\uACA8\uB193\uC73C\uBA74 \uC5B8\uC820\uAC00\uB294 \uC77D\uC744\uD150\uB370 \uC65C \uADF8\uB807\uAC8C \uBD80\uB2F4\uB4E4\uC744 \uC8FC\uB294\uC9C0 \uC6D0..",
