  "text" : "\uB0B4 \uC774\uB984\uC740 \uB9C9\uC2DC\uBB34\uC2A4 \uB370\uC2DC\uBB34\uC2A4 \uBA54\uB974\uB514\uC6B0\uC2A4. \uBD81\uBD80\uAD70 \uCD1D\uC0AC\uB839\uAD00\uC774\uC790 \uD3A0\uB9AD\uC758 \uC7A5\uAD70\uC774\uC5C8\uC73C\uBA70, \uC544\uC6B0\uB810\uB9AC\uC6B0\uC2A4 \uD669\uC81C\uC758 \uCDA9\uBCF5\uC774\uC5C8\uB2E4. \uADF8\uB9AC\uACE0 \uC0B4\uD574\uB2F9\uD55C \uC544\uB4E4\uC758 \uC544\uBC84\uC9C0\uC774\uC790 \uB2A5\uC695\uB2F9\uD55C \uC544\uB0B4\uC758 \uB0A8\uD3B8\uC774\uB2E4. \uBCF5\uC218\uD558\uACA0\uB2E4. \uC774\uBC88 \uC0DD\uC5D0\uC11C \uBCF5\uC218\uD558\uC9C0 \uBABB\uD55C\uB2E4\uBA74 \uB2E4\uC74C \uC0DD\uC5D0\uC11C\uB77C\uB3C4 \uAF2D.",
