  "text" : "\uADF8\uB7EC\uBA74\uC11C \uB0B4 \uC8FC\uBCC0\uC5D0\uB294 \uB0B4\uAC00 \uBA3C\uC800 \uC5F0\uB77D\uC744 \uD574\uC624\uC9C0 \uC54A\uC544\uB3C4 '\uC7E4\uAC00 \uC5EC\uC804\uD788 \uBC14\uC058\uAC8C \uC0B4\uACE0 \uC788\uAC70\uB098, \uC544\uB2C8\uBA74 \uC5F0\uC560\uB97C \uD558\uACE0 \uC788\uB098\uBCF4\uB2E4' \uB77C\uACE0 \uC0DD\uAC01\uD558\uACE0 \uADF8\uB7EC\uB824\uB2C8 \uD558\uB294 \uC0AC\uB78C\uB4E4\uB9CC \uB0A8\uAC8C \uB428.. \uC758\uB3C4\uCE58 \uC54A\uC740 \uAC00\uC9C0\uCE58\uAE30\uB97C \uD1B5\uD55C \uC790\uCCB4\uC815\uD654?; \uADF8\uB7F0 \uC0AC\uB78C\uB4E4\uACFC\uB294 \uC815\uB9D0 \uC624\uB798 \uAC00\uAC8C \uB418\uB354\uB77C.",
