  "text" : "\uADFC\uB370 \uADF8\uAC83\uB3C4 \uC545\uC21C\uD658\uC774 \uB418\uC5B4 \uB098\uC758 \uBAA9\uC744 \uC8C4\uC5B4\uC624\uB294 \uACBD\uC6B0\uAC00 \uC885\uC885 \uC788\uB2E4. \uB0B4\uAC00 \uBA3C\uC800 \uC5F0\uB77D\uC744 \uC798 \uC548\uD558\uB2E4\uBCF4\uB2C8, \uB418\uB824 '\uB0B4\uAC00 \uAC11\uC790\uAE30 \uC5F0\uB77D\uC744 \uD558\uBA74 \uBB54\uAC00 \uC9C0 \uD544\uC694\uD55C\uAC70 \uC788\uC744\uB54C\uB9CC \uC5F0\uB77D\uD558\uB294 \uC0AC\uB78C\uCC98\uB7FC \uBCF4\uC774\uB294\uAC8C \uC544\uB2D0\uAE4C' \uC2F6\uC5B4 \uC54C\uC544\uC11C \uAE68\uAC31\uD558\uACE0 \uC5F0\uB77D\uC744 \uB354 \uC548\uD558\uAC8C \uB418\uB294 \uD3B8",
