  "text" : "\uD604 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC7A5\uC778 \uC774\uAC15\uAD6D\uC528\uC640 \uCC28\uAE30 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC7A5 \uD6C4\uBCF4\uB85C \uC9C0\uBA85\uB41C \uC774\uB3D9\uD761\uC528\uB294 \uC704\uC548\uBD80 \uAD00\uB828 \uD5CC\uC7AC \uD310\uB840\uC640 \uCE5C\uC77C\uC7AC\uC0B0\uD658\uC218\uBC95 \uAD00\uB828 \uD5CC\uC7AC \uD310\uB840\uC5D0\uC11C \uB3D9\uC77C\uD55C \uC758\uACAC\uC744 \uC81C\uCD9C\uD588\uC9C0\uB9CC, \uB450 \uC0AC\uB78C\uC5D0 \uB300\uD55C \uC0AC\uB78C\uB4E4\uC758 \uBC18\uC751\uC774 \uB108\uBB34\uB098 \uB2E4\uB978 \uAC83\uC744 \uBCF4\uACE0 \uC788\uC790\uBA74 \uC815\uB9D0 \uC7AC\uBBF8\uC788\uAE30\uB294 \uD574\uC694. \uD750\uD750\uD750\uD750",
