  "text" : "\uC81C\uAC00 \uC815\uB9D0 \uAD81\uAE08\uD574\uC11C \uADF8\uB7EC\uB294\uB370.. \uBC95\uD559\uAD50\uC218\uB098 \uD310\uC0AC, \uAC80\uC0AC, \uBCC0\uD638\uC0AC \uB4F1\uC758 \uBC95\uB960\uAC00\uB4E4 \uC911\uC5D0\uC11C \"\uC704\uC548\uBD80 \uD310\uB840\uC5D0\uC11C\uC758 \uC774\uB3D9\uD761\uC528\uAC00 \uC81C\uCD9C\uD55C \uBC18\uB300\uC758\uACAC\" \uADF8 \uC790\uCCB4\uC5D0 \uB300\uD574 \uBE44\uD310\uD558\uB358 \uC0AC\uB78C\uC774 \uC788\uB098\uC694? \uC81C\uAC00 \uC544\uC9C1\uAE4C\uC9C0\uB294 \uADF8\uB7F0 \uBC95\uB960\uAC00\uB97C \uBCF8 \uC801\uC774 \uC5C6\uB294 \uAC83 \uAC19\uC740\uB370.",
