  "text" : "'\uC138\uC0C1\uC744 \uBC14\uAFC0 \uC218 \uC788\uB294 \uAC00\uC7A5 \uD604\uC2E4\uC801\uC778 \uC9C1\uC5C5\uC740 \uD310\uC0AC'\uB77C\uB294 \uC0DD\uAC01\uC5D0\uB294 \uC608\uB098 \uC9C0\uAE08\uC774\uB098 \uBCC0\uD568\uC774 \uC5C6\uB2E4. \uAC01\uC885 \uBD80\uC870\uB9AC \uB4F1\uC744 \uC790\uC2E0\uC758 \uC591\uC2EC\uACFC \uD5CC\uBC95, \uBC95\uB960\uC5D0 \uAE30\uCD08\uD55C \uD310\uB2E8\uC5D0 \uC758\uAC70\uD558\uC5EC \uBC95\uBD09\uC744 \uB450\uB4DC\uB9AC\uB294 \uAC83 \uD558\uB098\uB85C \uBD88\uBC95\uC774\uB77C \uADDC\uC815\uD558\uACE0 \uADF8\uC5D0 \uB300\uD55C \uCC98\uBC8C\uAE4C\uC9C0 \uD560 \uC218 \uC788\uC73C\uB2C8 \uB9D0\uC774\uC9C0..",
