  "text" : "\uADF8\uB7EC\uB2E4\uAC00 \uB0B4\uAC00 \uC5EC\uAE30 \uCC38\uC11D\uD574\uC11C \uBC31\uB9C8\uB514\uB97C \uB9D0\uD558\uACE0 \uC788\uB294 \uAC83\uBCF4\uB2E4\uB294, \uADF8 \uC2DC\uAC04\uC5D0 1\uBD84\uC774\uB77C\uB3C4 \uB354 \uACF5\uBD80\uD574\uC11C \uBC95\uB960\uAC00\uB85C \uC131\uACF5\uD558\uC5EC \uB0B4\uAC00 \uD558\uB294 \uD55C\uB9C8\uB514 \uB9D0\uC5D0\uB3C4 \uC911\uB7C9\uAC10\uC744 \uC2E4\uC5B4\uC8FC\uB294 \uAC83\uC774 \uB354 \uD604\uC2E4\uC801\uC774\uACA0\uB2E4- \uB77C\uACE0 \uC0DD\uAC01\uD558\uAC8C \uB418\uC5C8\uACE0, \uADF8 \uC774\uD6C4\uB85C\uB294 \uC9D1\uD68C \uB4F1\uC5D0 \uCC38\uC11D\uC744 \uC548\uD558\uAC8C \uB418\uB354\uB77C\uACE0.",
