  "text" : "\uC774\uB3D9\uD761\uC528\uC758 \uD310\uACB0 \uADF8 \uC790\uCCB4\uC5D0 \uB300\uD55C \uBE44\uD310\uC740 \uADF8\uB2E4\uC9C0 \uB3D9\uC758\uD558\uACE0 \uC2F6\uC9C0 \uC54A\uB124\uC694. \uBC95\uAD00\uC774 '\uBC95\uB960\uACFC \uC790\uC2E0\uC758 \uC591\uC2EC\uC5D0 \uB530\uB77C' \uC7AC\uD310\uC744 \uD588\uB2E4\uBA74 (\uC815\uB9D0 \uB9D0\uB3C4 \uC548\uB418\uB294- \uAC1C\uB5A1\uAC19\uC740 \uACAC\uD574\uB97C \uC81C\uC2DC\uD558\uC9C0 \uC54A\uC740 \uC774\uC0C1\uC740) \uADF8\uAC78\uB85C \uBC95\uAD00\uC73C\uB85C\uC11C\uC758 \uC18C\uC784\uC740 \uCDA9\uBD84\uD788 \uB2E4\uD55C \uAC83\uC774 \uC544\uB2D0\uAE4C \uC2F6\uC740\uB370..",
