  "text" : "\uADF8\uB9AC\uACE0 \uC774\uB3D9\uD761\uC774 \uD574\uB2F9 \uD310\uACB0\uB85C \uBE44\uB09C\uC744 \uBC1B\uC544\uC57C \uD55C\uB2E4\uBA74, \uC774\uB3D9\uD761\uACFC \uB3D9\uC77C\uD55C \uC758\uACAC\uC744 \uB0C8\uC5C8\uB358 \uC774\uAC15\uAD6D \uC7AC\uD310\uAD00(\uD604 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC7A5)\uC774 \uD5CC\uC7AC\uC18C\uC7A5\uC5D0 \uC784\uBA85\uB420 \uB2F9\uC2DC\uC5D4 \uB2E4\uB4E4 \uC65C \uC774\uB807\uAC8C \uC870\uC6A9\uD588\uB098 \uC2F6\uAE30\uB3C4 \uD558\uACE0.. (\uAC8C\uB2E4\uAC00 \uC774\uAC15\uAD6D\uC740 \uC774\uB3D9\uD761\uC758 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC7A5 \uB0B4\uC815\uC5D0 \uBC18\uB300\uD558\uACE0 \uC788\uB294 \uC785\uC7A5\u314B)",
