  "text" : "\uC774\uB294 \uADF8\uB54C\uAE4C\uC9C0 \uC788\uB358 \uC720\uC0AC\uD55C \uCF00\uC774\uC2A4\uB4E4\uC744 \uB2E4\uB918\uB358 \uC774\uC804\uC758 \uD5CC\uC7AC \uD310\uB840\uB4E4\uC5D0\uC11C\uB3C4 \uBCFC \uC218 \uC788\uB294, \uD5CC\uBC95\uC7AC\uD310\uC18C\uC758 \uC77C\uAD00\uB41C \uC785\uC7A5\uC774\uC5C8\uAC70\uB4E0\uC694. \uC0AC\uC2E4 \uC774 \uD310\uACB0\uBB38 \uB098\uC654\uC744 \uB54C, \uAF64 \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC774 \"\uC5B4? \uB808\uC54C?? \uC9C4\uC9DC??? \uC6CC..\" \uBB50 \uC774\uB7F0 \uBC18\uC751\uC774\uC5C8\uB358 \uAC83\uC73C\uB85C \uAE30\uC5B5..",
