  "text" : "\uD5CC\uBC95\uACFC \uBC95\uB960\uC758 \uADDC\uC815 \uBC0F \uADF8\uC5D0 \uAD00\uD55C \uD5CC\uBC95\uC801 \uBC95\uB9AC\uD574\uC11D\uC758 \uD55C\uACC4\uB97C \uB118\uC5B4\uC11C\uAE4C\uC9C0 \uAD6D\uAC00\uC5D0\uAC8C \uADF8 \uC678\uAD50\uC801 \uBB38\uC81C\uD574\uACB0\uC744 \uAC15\uC81C\uD560 \uC218\uB294 \uC5C6\uB2E4. \uC774\uB294 \uAD8C\uB825\uBD84\uB9BD\uC758 \uC6D0\uCE59\uC0C1 \uD5CC\uBC95\uC7AC\uD310\uC18C\uAC00 \uC9C0\uCF1C\uC57C \uD558\uB294 \uD5CC\uBC95\uC801 \uD55C\uACC4\uC774\uB2E4.\" \uB77C\uBA70 \uBC18\uB300\uC758\uACAC\uC744 \uD45C\uC2DC\uD588\uC2B5\uB2C8\uB2E4. \uBC95\uB9AC\uC801\uC73C\uB85C\uB294 \uC774\uD574\uAC00 \uB418\uB294..",
