  "text" : "\uC774\uB3D9\uD761\uC528 \uC758\uACAC\uC744 \uC778\uC6A9\uD574 \uBCF4\uC790\uBA74.. \"\uAC15\uC81C\uB85C \uC704\uC548\uBD80\uB85C \uB3D9\uC6D0\uB41C \uD6C4 \uC778\uAC04\uC758 \uC874\uC5C4\uACFC \uAC00\uCE58\uB9C8\uC800 \uC1A1\uB450\uB9AC\uC9F8 \uBC15\uD0C8\uB2F9\uD55C \uC774 \uC0AC\uAC74 \uCCAD\uAD6C\uC778\uB4E4\uC758 \uAE30\uBCF8\uAD8C\uC744 \uAD6C\uC81C\uD574 \uC8FC\uC5B4\uC57C \uD560 \uC808\uBC15\uD55C \uC2EC\uC815\uC744 \uC0DD\uAC01\uD558\uBA74 \uC5B4\uB5A0\uD55C \uBC29\uBC95\uC73C\uB85C\uB4E0 \uAD6D\uAC00\uC801 \uB178\uB825\uC744 \uB2E4\uD574 \uC8FC\uC5C8\uC73C\uBA74 \uD558\uB294 \uBC14\uB78C\uC740 \uC6B0\uB9AC \uBAA8\uB450 \uAC04\uC808\uD558\uB098",
