  "text" : "\uB2E4\uC218\uC758\uACAC\uACFC\uB294 \uB2E4\uB974\uAC8C \uD569\uD5CC\uC758\uACAC\uC744 \uB0C8\uB358 \uC774\uB3D9\uD761 \uC7AC\uD310\uAD00\uACFC \uC774\uAC15\uAD6D, \uBBFC\uD615\uAE30 \uC7AC\uD310\uAD00 \uC5ED\uC2DC\uB3C4 \uADF8\uB54C\uAE4C\uC9C0\uC758 \uD5CC\uBC95\uC7AC\uD310\uC18C \uC785\uC7A5\uACFC \uB3D9\uC77C\uD55C \uACAC\uD574\uB97C \uC81C\uC2DC\uD588\uAD6C\uC694. \uC2E4\uC81C \uD310\uACB0\uBB38\uC5D0\uC11C\uB3C4 \uC774\uB3D9\uD761, \uC774\uAC15\uAD6D, \uBBFC\uD615\uAE30 \uC7AC\uD310\uAD00\uC740 '\uC774\uB294 \uC6B0\uB9AC \uC7AC\uD310\uC18C\uC758 \uD655\uB9BD\uB41C \uD310\uB840\uC774\uAE30\uB3C4 \uD558\uB2E4'\uB77C\uACE0 \uC368\uB1A8\uC2B5\uB2C8\uB2E4.",
