  "text" : "\uC0AC\uC2E4.. \uC704\uC548\uBD80\uD53C\uD574\uC790\uC758 \uBC30\uC0C1\uCCAD\uAD6C\uAD8C\uC5D0 \uAD00\uD55C \uD574\uB2F9 \uD310\uACB0\uC740 \uADF8\uB54C\uAE4C\uC9C0\uC758 \uD5CC\uC7AC \uD310\uACB0\uACFC\uB294 \uB2E4\uB978, \uC880 \uD30C\uACA9\uC801\uC778 \uD310\uACB0\uC774\uC5C8\uC5B4\uC694. \uADF8\uC640 \uC720\uC0AC\uD55C \uB2E4\uB978 \uCF00\uC774\uC2A4\uB4E4\uC5D0\uC11C\uB294 \uD5CC\uC7AC\uAC00 \uC704\uC548\uBD80\uD53C\uD574\uC790\uC758 \uBC30\uC0C1\uCCAD\uAD6C\uAD8C \uD310\uB840\uC640\uB294 \uB2E4\uB974\uAC8C \uD569\uD5CC\uC73C\uB85C \uD310\uB2E8\uC744 \uD574\uC654\uC5C8\uAC70\uB4E0\uC694.",
