  "text" : "\uB530\uB77C\uC11C \uC774 \uC0AC\uAC74 \uBC95\uB960\uC870\uD56D\uC740 \uAD70 \uB0B4\uBD80\uC758 \uAC74\uC804\uD55C \uACF5\uC801\uC0DD\uD65C\uC744 \uC601\uC704\uD558\uACE0, \uAD70 \uC870\uC9C1 \uC804\uCCB4\uC758 \uC131\uC801\uAC74\uAC15\uC744 \uC720\uC9C0\uD558\uAE30 \uC704\uD558\uC5EC \uC81C\uC815\uB41C \uAC83\uC73C\uB85C\uC11C, \uC8FC\uB41C \uBCF4\uD638\uBC95\uC775\uC740 \u2018\uAC1C\uC778\uC758 \uC131\uC801 \uC790\uC720\u2019\uAC00 \uC544\uB2C8\uB77C \u2018\uAD70\uC774\uB77C\uB294 \uACF5\uB3D9\uC0AC\uD68C\uC758 \uAC74\uC804\uD55C \uC0DD\uD65C\uACFC \uAD70\uAE30\u2019\uB77C\uB294 \uC0AC\uD68C\uC801 \uBC95\uC775\uC774\uB77C \uD560 \uAC83\uC774\uB2E4.",
