  "text" : "\uD615\uBC95\uC774\uB098 \uADF8 \uC678 \uD2B9\uBCC4\uBC95 \uB4F1\uC5D0\uC11C \uC774\uBBF8 \uCD94\uD589\uACFC \uAD00\uB828\uB41C \uC870\uD56D\uC744 \uB450\uACE0 \uC788\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uAD70\uD615\uBC95\uC774 \uCD94\uD589\uC5D0 \uAD00\uD558\uC5EC \uBCC4\uB3C4\uC758 \uCC98\uBC8C\uADDC\uC815\uC744 \uB454 \uAC83\uC740, \uC0C1\uBA85\uD558\uBCF5\uC758 \uC5C4\uACA9\uD55C \uADDC\uC728\uACFC \uC9D1\uB2E8\uC801 \uACF5\uB3D9\uC0DD\uD65C\uC744 \uBCF8\uC9C8\uB85C \uD558\uB294 \uAD70\uB300\uC758 \uD2B9\uC218\uD55C \uC0AC\uC815\uC744 \uACE0\uB824\uD55C \uAC83\uC774\uB2E4.",
