  "text" : "\uC2E4\uC81C\uB85C \uD5CC\uBC95\uC7AC\uD310\uC18C\uAC00 \uC9C0\uAE08\uAE4C\uC9C0 \uB0B4\uB838\uB358 \uC591\uC2EC\uC801 \uBCD1\uC5ED\uAC70\uBD80 \uAD00\uB828 \uD310\uB840\uB4E4\uC744 \uC0B4\uD3B4\uBCF4\uBA74, \uC591\uC2EC\uC801 \uBCD1\uC5ED\uAC70\uBD80 \uC81C\uB3C4\uB77C\uB358\uAC00 \uB300\uC548\uC801 \uBCD1\uC5ED\uC758\uBB34 \uB4F1\uC758 \uBCF4\uC644\uCC45\uC744 \uB3C4\uC785\uD560 \uAC83\uC744 \uC785\uBC95\uC790\uC5D0\uAC8C \uAD8C\uACE0\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uBB3C\uB860 \uAD8C\uACE0\uC774\uB2E4\uBCF4\uB2C8 \uAC15\uC81C\uB825\uC740 \uC5C6\uC5B4\uC694. '\uB3C4\uC785\uD558\uB294\uAC8C \uC88B\uC744 \uAC83 \uAC19\uC544' \uB77C\uB294 \uC218\uC900",
