  "text" : "\uCC38\uACE0\uB85C \uD5CC\uBC95\uC7AC\uD310\uC18C\uB294 '\uC591\uC2EC\uC801 \uBCD1\uC5ED \uAC70\uBD80\uC81C\uB3C4'\uC5D0 \uB300\uD574\uC11C \uBD80\uC815\uC801\uC778 \uC785\uC7A5\uC774 \uC544\uB2C8\uC5D0\uC694. \uC624\uD788\uB824 \uADF8 \uC81C\uB3C4 \uC790\uCCB4\uB294 \uBB3C\uB860\uC774\uAC70\uB2C8\uC640, \uB3C4\uC785\uC5D0 \uC788\uC5B4\uC11C\uB3C4 \uAE0D\uC815\uC801\uC778 \uC785\uC7A5\uC774\uC5D0\uC694. \uB2E4\uB9CC, '\uD55C\uBC18\uB3C4\uC758 \uB300\uCE58\uC0C1\uD669 \uB4F1\uC758 \uC774\uC720\uB85C \uC774\uB97C \uC81C\uD55C\uD558\uB294 \uAC83\uB3C4 \uC5ED\uC2DC \uC815\uB2F9\uD558\uB2E4' \uB77C\uB294 \uC785\uC7A5\uC77C \uBFD0\uC774\uC8E0.",
