  "text" : "\uC774\uBC88 \uD3ED\uD2B8\uC2DC\uC98C\uC774 \uC5B8\uC81C\uAE4C\uC9C0\uAC00 \uB420\uC9C0\uB294 \uC798 \uBAA8\uB974\uACA0\uC9C0\uB9CC, \uC870\uB9CC\uAC04 \uC2DC\uC98C \uB9C8\uAC10\uC744 \uD560 \uAC83 \uAC19\uAE30\uB3C4 \uD558\uB2E4. \uADF8 \uC804\uC5D0 \uCE5C\uD574\uC84C\uB358 \uC0AC\uB78C\uB4E4\uACFC \uC624\uD504\uB3C4 \uD558\uACE0, \uC5F0\uB77D\uB3C4 \uD558\uACE0 \uADF8\uB7EC\uB2E4\uAC00 \uB3CC\uC544\uC624\uBA74 \uB610\uB2E4\uC2DC \uBAA8\uB974\uB294 \uC0AC\uB78C\uB4E4\uC774 \uBC14\uAE00\uBC14\uAE00 \uD558\uACA0\uC9C0. \uC74C",
