  "text" : "[\uAD70\uB300\uAD34\uB2F4 51] \uADF8\uB7AC\uB354\uB2C8 \uBBF8\uACB0\uC218 \uC911 \uD558\uB098\uAC00 '\uADF8\uAC78 \uC6B0\uB9AC\uAC00 \uC65C \uC2E0\uACBD\uC368\uC57C \uD558\uB290\uB0D0, \uC9D5\uACC4\uBCD1\uB4E4 \uC2E0\uACBD \uC4F0\uB294\uAC74 \uC6B0\uB9AC\uAC00 \uC544\uB2C8\uB77C \uADFC\uBB34\uC790\uB4E4 \uBAAB \uC544\uB2C8\uB0D0?' \uB77C\uACE0 \uC9C0\uAEC4\uC774\uB354\uB77C. \uC774\uC0C8\uB07C\uAC00.. \uC21C\uAC04 \uB9C8\uC74C\uC18D \uAE4A\uC740 \uACF3\uC5D0\uC11C '\uC800\uC0C9\uD76C\uB294 \uCD1D\uC0B4\uD615\uC744 \uC120\uACE0\uBC1B\uAC8C \uD574\uC8FC\uC138\uC694'\uB77C\uB294 \uC0DD\uAC01\uC774 \uB4E4..",
