  "text" : "[\uAD70\uB300\uAD34\uB2F4 50] \uADFC\uB370 \uC774 \uC50C\uBC1C(\uD760\uD760) \uBBF8\uACB0\uC218\uB4E4\uC774 \uC815\uB9D0 \uAC1C\uAC1D\uB07C\uB4E4\uC774\uB77C\uC11C.. \uC9C0\uB4E4\uC774 \uBA39\uACE0 \uB09C \uC2DD\uD310\uACFC \uD14C\uC774\uBE14 \uC815\uB9AC\uB3C4 \uC548\uD558\uB294\uB370\uB2E4, \uB4B7\uC0AC\uB78C \uC0DD\uAC01\uB3C4 \uC548\uD558\uACE0 \uC74C\uC2DD\uC744 \uCC98\uBA39\uB294\uB2E4. \uC785\uB9DB\uC5D0 \uB9DE\uB294 \uC74C\uC2DD\uC774 \uB098\uC624\uBA74 \uCCD0\uBB35\uCCD0\uBB35. \uC624\uC8FD\uD588\uC73C\uBA74 \uADFC\uBB34\uC790\uB4E4\uC774 \uB4B7\uC0AC\uB78C \uC0DD\uAC01\uB3C4 \uD558\uB77C\uACE0 \uD588\uACA0\uC5B4.",
