  "text" : "[\uAD70\uB300\uAD34\uB2F4 48] \uBC25\uC744 \uBA39\uC73C\uB7EC \uB098\uAC08\uB54C\uB3C4 \uC0AC\uB791\uC744 \uC678\uCCD0\uC57C \uD588\uACE0, \uB625\uC744 \uC2F8\uB7EC \uAC08 \uB54C\uC5D0\uB3C4 \uC0AC\uB791\uC744 \uC678\uCE58\uC790\uB2C8 \uCC38 \uC8FD\uC744 \uB9DB\uC774\uC5C8\uB2E4. \uBB50.. \uADF8\uB798\uB3C4 \uC601\uCC3D\uC744 \uB098\uBCF4\uB2E4 \uBA3C\uC800 \uB2E4\uB140\uC628 \uC120\uC784(\uADF8\uB54C \uB0B4\uAC00 \uADFC\uBB34\uD588\uB358 \uC139\uC158\uC740 \uC904\uC601\uCC3D;)\uC774 \uBBF8\uB9AC \uC774\uC57C\uAE30\uB97C \uD574\uC900 \uB355\uBD84\uC5D0 \uBE75 \uD130\uC9C0\uC9C0\uB294 \uC54A\uC558\uC74C\u314B",
