  "text" : "[\uAD70\uB300\uAD34\uB2F4 47] \uBCF4\uACE0\uBC29\uC2DD\uC740 \uB2E4\uC74C\uACFC \uAC19\uC74C. \"XX\uBD84\uB300 \uC9D5\uACC4\uBCD1 XXX, \uC6A9\uBB34 \uC788\uC2B5\uB2C8\uB2E4. \uC6A9\uBB34\uB294 XXX\uC785\uB2C8\uB2E4.\" \uADF8\uB7EC\uBA74 \uADFC\uBB34\uC790\uAC00 \uC640\uC11C \uBB38\uC744 \uC5F4\uC5B4\uC8FC\uB294\uB370, \uBB38\uC744 \uB098\uAC00\uB294 \uC21C\uAC04\uC5D0 \uC9D5\uACC4\uBCD1\uC740 \uD574\uB2F9 \uBD84\uB300\uC758 \uBA85\uCE6D\uC744 \uC678\uCCD0\uC57C \uD55C\uB2E4. \uB2E4\uC2DC \uD55C\uBC88 \uB9D0\uD558\uC9C0\uB9CC \uC6B0\uB9AC \uBD84\uB300\uB294 \uC0AC\uB791..",
