  "text" : "[\uAD70\uB300\uAD34\uB2F4 46] \uD654\uC7A5\uC2E4 \uB4F1\uC758 \uC6A9\uAC74 \uB54C\uBB38\uC5D0 \uC9D5\uACC4\uBC29\uC744 \uB098\uAC00\uC57C \uD560 \uB54C\uC5D0\uB294 \uC790\uB9AC\uB97C \uC815\uB3C8\uD558\uACE0, \uC790\uC2E0\uC774 \uAE54\uACE0 \uC549\uC558\uB358 \uBC29\uC11D\uC744 \uC0C1 \uC704\uC5D0 \uC62C\uB824\uB454 \uB4A4\uC5D0 \uC9D5\uACC4\uC2E4 \uC785\uAD6C\uC5D0 \uAC00\uC11C \uCC28\uB837\uC790\uC138\uB85C \uC120\uB2E4. \uADF8\uB9AC\uACE0\uB294 \uADFC\uBB34\uC790(\uD5CC\uBCD1)\uC744 \uBD88\uB7EC\uC11C \uC790\uC2E0\uC758 \uC6A9\uAC74\uC744 \uBCF4\uACE0\uD55C\uB2E4.",
