  "text" : "[\uAD70\uB300\uAD34\uB2F4 35] \uADF8\uB9AC\uACE0\uC11C\uB294 \uC0AC\uBB34\uC2E4\uB85C \uB3CC\uC544\uC640 \"\uC57C, \uB2E4\uC74C\uBC88 \uC2E0\uBCD1 \uBF51\uC744 \uB54C\uB294 \uBD80\uBAA8\uAC00 XX\uC5D0 \uC885\uC0AC\uD558\uB294 \uC560\uB4E4\uB85C \uBF51\uC544\uBD10\uB77C\" \uB77C\uACE0 \uD558\uB294 \uAC04\uBD80\uB4E4\uB3C4 \uC885\uC885 \uC788\uC5C8\uC74C. \uADF8\uB7F0 \uC18C\uB9AC\uB97C \uB4E4\uC744 \uB54C\uB9C8\uB2E4 \uC0C1\uB2F9\uC218\uB97C \uCC28\uC9C0\uD558\uB294 \uAD6D\uB0B4\uD30C \uCE74\uD22C\uC0AC\uB4E4\uACFC \uD3C9\uBC94\uD55C \uC9D1 \uCE74\uD22C\uC0AC\uB4E4\uC740 \uADF8\uC800 \uD3ED\uD48D\uAD34\uB9AC\uAC10..",
