  "text" : "[\uAD70\uB300\uAD34\uB2F4 34] \uADF8\uB7EC\uB354\uB2C8 \uC5B4\uB290 \uC21C\uAC04\uBD80\uD130\uB294 \"\uC774\uBC88\uC5D0 \uB4E4\uC5B4\uC628\uC560\uB294 \uBD80\uBAA8\uAC00 \uB458 \uB2E4 \uC758\uB300 \uAD50\uC218\uB354\uB77C\uACE0. \uADF8\uB798\uC11C \uC6B0\uB9AC \uC5B4\uBA38\uB2C8 \uC785\uC6D0\uD558\uC2E4 \uB54C \uB3C4\uC6C0\uC880 \uBC1B\uC558\uC5B4\", \"\uC6B0\uB9AC\uC560\uB294 \uC54C\uACE0\uBD24\uB354\uB2C8 \uC544\uBC84\uC9C0\uAC00 \uC5BC\uB9C8\uC804 \uB274\uC2A4\uC5D0\uB3C4 \uB098\uC654\uB358 \uD07C\uC9C1\uD55C \uC0AC\uAC74\uC758 \uB2F4\uB2F9\uAC80\uC0AC\uB354\uB77C. \uB098\uC911\uC5D0 \uB3C4\uC6C0\uC880 \uBC1B\uC544\uC57C\uC9C0\"",
