  "text" : "[\uAD70\uB300\uAD34\uB2F4 33] \uADF8\uB9AC\uACE0\uB294 \uC790\uC2E0\uC774 \uBF51\uC740 \uBCD1\uC0AC\uB97C \uAC00\uC9C0\uACE0 \uB2E4\uB978 \uAC04\uBD80\uC640 \uD3EC\uCF13\uBAAC\uC2A4\uD130 \uBC30\uD2C0\uC744 \uC2DC\uC791. \"\uC774\uBC88\uC5D0 \uBF51\uC740 \uC560\uB294 \uD558\uBC84\uB4DC\uB2E4!\", \"\uD6D7, \uB0B4\uAC00 \uBF51\uC740 \uC560\uB294 \uC625\uC2A4\uD37C\uB4E0\uB370?\", \"\uC57C, \uC6B0\uB9AC \uC139\uC158\uC5D0\uB294 \uC874\uC2A4\uD649\uD0A8\uC2A4 \uC758\uB300\uC560\uAC00 \uB4E4\uC5B4\uC654\uB354\uB77C\uACE0\", \"\uC6B0\uB9AC\uB294 \uC0AC\uC2DC\uD569\uACA9\uC0DD \uC788\uC9C0\uB871\"",
