  "text" : "[\uAD70\uB300\uAD34\uB2F4 32] \uC77C\uBD80 \uD55C\uAD6D\uAD70 \uAC04\uBD80\uB4E4\uC5D0\uAC8C \uC788\uC5B4 \uCE74\uD22C\uC0AC\uB098 \uAD6D\uAD70 \uC5B4\uD559\uBCD1\uC774\uB780 \uC5B4\uCA4C\uBA74 \uD3EC\uCF13\uBAAC\uC2A4\uD130\uC640 \uBE44\uC2B7\uD55C \uC874\uC7AC\uC600\uC744\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB2E4. \uC139\uC158\uC5D0 \uD544\uC694\uD55C \uBCD1\uC0AC\uB97C \uC120\uBC1C\uD560 \uB54C \uC2E4\uBB34\uB2A5\uB825 \uB4F1\uACFC\uB294 \uC0C1\uAD00\uC5C6\uC774 \uADF8\uC800 \uD574\uB2F9 \uBCD1\uC0AC\uC758 \uD559\uBC8C\uACFC \uBD80\uBAA8\uC758 \uC9C1\uC5C5\uC744 \uCD5C\uC6B0\uC120 \uD558\uB358 \uAC04\uBD80\uB4E4\uC774 \uC885\uC885 \uC788\uC5C8\uC74C",
