  "text" : "[\uAD70\uB300\uAD34\uB2F4 31] \uAC8C\uB2E4\uAC00 \uBBF8\uAD70\uBCF5\uC778 ACU\uB97C \uC785\uD600\uB193\uC73C\uBA74 \uB098\uB984 \uAD70\uBCF5\uBC84\uD504\uB3C4 \uAC00\uB2A5\uD558\uACE0(...) \uAE38\uAC70\uB9AC\uC5D0\uC11C \uBBF8\uAD70\uBCF5\uC744 \uC785\uACE0 \uB3CC\uC544\uB2E4\uB2C8\uB294 \uCE74\uD22C\uC0AC\uC640 \uB9C8\uC8FC\uCCE4\uB2E4\uBA74 \uC544\uB9C8 \uC14B \uC911 \uD558\uB098\uC785\uB2C8\uB2E4. \uC5C5\uBB34\uC218\uD589\uC911\uC774\uAC70\uB098, \uCE74\uBD80\uC2EC \uCA4C\uB294 \uCE74\uD22C\uC0AC\uC774\uAC70\uB098, \uC544\uB2C8\uBA74 \uC0C1\uB300\uAC00 \uC694\uAD6C\uD574\uC11C \uC785\uACE0 \uB098\uC654\uAC70\uB098.",
