  "text" : "\uC5EC\uD2BC, \uB098\uC758 \uAD70\uB300\uAD34\uB2F4 \uC2DC\uB9AC\uC988(\uC5C4\uBC00\uD788 \uB9D0\uD558\uC790\uBA74 \uCE74\uD22C\uC0AC\uAD34\uB2F4)\uB294 \uADF8\uB2E4\uC9C0 \uD765\uD558\uC9C0 \uBABB\uD55C \uAC83 \uAC19\uB2E4. No.28\uAE4C\uC9C0 \uC37C\uB294\uB370\uB3C4 \uBCC4 \uBC18\uC751\uB4E4\uC774 \uC5C6\uB13C\u314B\u314B\u314B \uC800 \uC5ED\uC2DC\uB3C4 \uAD00\uC2EC\uC744 \uBA39\uACE0 \uC0AC\uB294 \uCC9C\uBC15\uD55C \uC885\uC790\uC774\uBBC0\uB85C, \uC0AC\uC5C5\uC131\uC774 \uC5C6\uB294 \uC544\uC774\uD15C\uC740 \uCD5C\uB300\uD55C \uBE68\uB9AC \uC811\uACA0\uC74D\uB2C8\uB2E4.",
