  "id_str" : "290773853662236672",
  "text" : "[\uAD70\uB300\uAD34\uB2F4 28] \uADF8\uB7F0 \uC77C\uC774 \uC790\uC8FC \uC788\uC5C8\uB358\uAC74 \uC544\uB2C8\uACE0, \uAD70\uC0DD\uD65C \uD558\uBA74\uC11C \uB531 6\uBC88 \uC788\uC5C8\uC74C. \uB9D0\uB3C4 \uC548\uD1B5\uD558\uB294\uB370 \uC5B4\uB5BB\uAC8C \uB530\uB77C \uB4E4\uC5B4\uC654\uC744\uAE4C \uC2F6\uAE30\uB3C4 \uD558\uC9C0\uB9CC, \uC0DD\uAC01\uD574\uBCF4\uBA74 \uBC14\uB514\uB7AD\uADC0\uC9C0\uB294 \uB9CC\uAD6D\uACF5\uD1B5\uC5B4\uB2C8\uAE4C -_- \uC5EC\uD2BC\uAC04\uC5D0.. \uC660\uB9CC\uD558\uBA74 \uD074\uB7FD \uB4F1\uC5D0\uC11C \uBBF8\uAD70\uC560\uB4E4 \uB530\uB77C\uAC00\uC9C0 \uB9D0\uC544\uC694",
