  "text" : "[\uAD70\uB300\uAD34\uB2F4 27] \uADF8\uB7F4\uB54C\uB9C8\uB2E4 \uD55C\uC228 \uD479 \uC26C\uBA74\uC11C \uB2E4\uAC00\uAC00 \uD639\uC2DC \uD55C\uAD6D\uC0AC\uB78C\uC774\uB0D0\uACE0 \uBB3C\uC5B4\uBD24\uACE0, \uADF8\uB798\uC8FC\uBA74 \uC815\uB9D0 \uBC18\uAC00\uC6CC\uD558\uB354\uB77C(...) \uADF8\uB7EC\uBA74 \uCF5C\uD0DD\uC2DC\uB97C \uBD88\uB7EC\uB2E4\uAC00 \uB179\uC0AC\uD3C9\uC5ED\uC774\uB098 \uC0BC\uAC01\uC9C0\uC5ED, \uC219\uB300\uC785\uAD6C \uCABD\uC73C\uB85C \uD0DC\uC6CC\uBCF4\uB0B4\uBA74\uC11C '\uC55E\uC73C\uB85C\uB294 \uC9E7\uC740\uBA38\uB9AC \uBBF8\uAD6D\uC560\uB4E4 \uB530\uB77C\uC624\uC9C0 \uB9D0\uC544\uC694'\uB77C\uACE0 \uB9D0\uD574\uC90C",
