  "text" : "[\uAD70\uB300\uAD34\uB2F4 26] \uADF8\uB807\uAC8C \uBBF8\uAD70\uACFC \uD55C\uAD6D\uB140\uC131\uC774 \uBBF8\uAD70\uAE30\uC9C0\uC5D0\uC11C \uBD88\uD0C0\uB294 \uBC24\uC744 \uBCF4\uB0B4\uACE0 \uB09C \uB2E4\uC74C\uB0A0 \uC544\uCE68\uC774\uBA74 \uC885\uC885 \uBBF8\uAD70\uC5D0\uAC8C \uBC84\uB9BC(?)\uBC1B\uC740 \uD55C\uAD6D\uB140\uC131\uC744 \uBC1C\uACAC\uD560 \uB584\uAC00 \uC788\uC5C8\uB2E4. \uC8FC\uB85C \uBC30\uB7ED \uC785\uAD6C\uC5D0\uC11C \uD6CC\uCA4D\uD6CC\uCA4D \uC6B8\uACE0 \uC788\uB354\uB77C\uACE0.. \uB9D0\uC740 \uC548\uD1B5\uD558\uACE0, \uC5EC\uAE30\uAC00 \uC5B4\uB518\uC9C0\uB3C4 \uBAA8\uB974\uB2C8 \uC554\uB2F4\uD588\uACA0\uC9C0",
