  "id_str" : "290771751896485888",
  "text" : "[\uAD70\uB300\uAD34\uB2F4 25] \uADF8\uB7F0 \uC0C1\uD669\uC744 \uCC98\uC74C \uACAA\uC5B4\uBCF8 \uCE74\uD22C\uC0AC \uB274\uBE44\uB4E4(\uD2B9\uD788 \uC720\uD559\uACBD\uD5D8\uC774 \uC5C6\uB294 \uAD6D\uB0B4\uD30C \uB274\uBE44\uB4E4)\uC758 \uACBD\uC6B0\uC5D0\uB294 \uADF8 \uC0C1\uD669\uC744 \uC5B4\uB5BB\uAC8C \uD0C0\uAC1C\uD574\uC57C \uD560\uC9C0\uC5D0 \uB300\uD574\uC11C \uC120\uC784\uB4E4\uC5D0\uAC8C \uC885\uC885 \uBB3C\uC5B4\uBCF4\uAE30\uB3C4 \uD588\uB294\uB370, \uB098\uB294 \uC774\uB807\uAC8C \uB300\uB2F5\uD588\uB2E4. \"\uC57C, \uBC30\uB7ED\uC5D0\uC11C\uB294 \uBA54\uB515\uB3C4 \uB098\uC624\uB294\uAC8C \uC815\uC0C1\uC774\uC57C.\"",
