  "id_str" : "290771283308855296",
  "text" : "[\uAD70\uB300\uAD34\uB2F4 24] \uADF8\uB798\uC11C \uC0E4\uC6CC\uC2E4\uC5D0 \uB4E4\uC5B4\uAC14\uB2E4\uAC00 \uB0AF\uC120 \uC5EC\uC778\uACFC \uB9C8\uC8FC\uCE58\uAC8C \uB418\uBA74 \uC624\uD788\uB824 \uCE74\uD22C\uC0AC(\uC8FC\uB85C \uB274\uBE44\uB4E4)\uAC00 \uAE5D\uB180\uD558\uAC8C \uB418\uB294 \uD3B8\uC774\uC5C8\uB358 \uB4EF. \uB098\uC911\uC5D0\uB294 \uADF8\uB0E5 \uBB34\uB364\uB364\uD574\uC838\uC11C \uBC14\uB514\uC0F4\uD478\uB791 \uC0F4\uD478\uB97C \uBE4C\uB824\uC8FC\uACE0, \uC0E4\uC6CC\uD558\uBA74\uC11C \uBED8\uB4DC\uB9BD\uC744 \uB358\uC9C0\uAE30\uB3C4(....) \uADF8\uB7EC\uD558\uB2E4.",
