  "id_str" : "290770798602498049",
  "text" : "[\uAD70\uB300\uAD34\uB2F4 23] \uBBF8\uAD70\uB4E4\uC744 \uB530\uB77C\uB4E4\uC5B4\uC628 \uD55C\uAD6D\uC5EC\uC790\uB4E4\uB3C4 '\uC5EC\uAE30\uB294 \uC678\uAD6D\uC774\uB2E4' \uB77C\uACE0 \uC0DD\uAC01\uC744 \uD558\uACE0 \uC788\uB294\uC9C0 \uC8FC\uBCC0\uC758 \uC2DC\uC120\uC5D0 \uBCC4\uB85C \uAC1C\uC758\uCE58 \uC54A\uB294 \uD3B8\uC774\uC5C8\uB358 \uB4EF \uC2F6\uC74C. \uADF8\uB798\uC11C \uBC29\uC5D0 \uB4E4\uC5B4\uAC00\uBA74 \uC8FD\uC5B4\uB77C\uACE0 \uC18C\uB9AC\uB97C \uC9C0\uB974\uBA70 \uC751\uC751\uC744 \uD558\uACE0, \uC0E4\uC6CC\uC2E4\uC5D0\uC11C \uB9C8\uC8FC\uCCD0\uB3C4 \uBCC4\uB85C \uBD80\uB044\uB7EC\uC6CC \uD558\uC9C0\uB3C4 \uC54A\uACE0",
