  "text" : "[\uAD70\uB300\uAD34\uB2F4 22] \uADF8\uB798\uB3C4 \uCE74\uD22C\uC0AC\uB4E4\uC740 \uBC30\uB7ED\uC5D0 \uC5EC\uC790\uB97C \uB370\uB824\uC624\uBA74 \uB098\uB984 \uC870\uC6A9\uD788 \uC751\uC751\uC744 \uD558\uACE0, \uC5EC\uC790\uAC00 \uC0E4\uC6CC\uB97C \uD558\uACE0 \uC788\uC744 \uB54C\uC5D0\uB294 \uC0E4\uC6CC\uC2E4 \uC55E\uC5D0 \uC11C\uC11C \uC9C0\uCF1C\uC8FC\uACE4 \uD558\uB294\uB370, \uC774\uC0C1\uD558\uAC8C\uB3C4 \uBBF8\uAD70\uB4E4\uC740 \uADF8\uB7F0\uAC8C \uAC70\uC758 \uC5C6\uC5C8\uC74C. \uC544\uBB34\uB798\uB3C4 '\uB2E4\uC2DC\uB294 \uB9C8\uC8FC\uCE60 \uC77C\uC774 \uC5C6\uB294 \uC0AC\uC774'\uB77C\uACE0 \uC0DD\uAC01\uD574\uC11C?",
