  "text" : "[\uAD70\uB300\uAD34\uB2F4 21] \uC8FC\uB9D0\uBC24\uB9CC \uB418\uBA74 \uBC30\uB7ED\uC740 \uB3D9\uBB3C\uC758 \uC655\uAD6D\uC774 \uB418\uACE4 \uD588\uB2E4. \uC591 \uC0AC\uC774\uB4DC\uC758 \uBC29\uC5D0\uC11C\uB294 \uC8FD\uB294\uB4EF\uD55C \uC2E0\uC74C\uC18C\uB9AC\uAC00 \uB4E4\uB824\uC624\uACE0, \uC717\uBC29\uC5D0\uC11C\uB294 \uCE68\uB300\uAC00 \uBD80\uC11C\uC838\uB77C \uD754\uB4E4\uAC70\uB9AC\uB294 \uCFF5\uB355\uCFF5\uB355 \uC18C\uB9AC\uAC00 \uB4E4\uB824\uC624\uACE0. \uC0E4\uC6CC\uC2E4\uC5D0 \uB4E4\uC5B4\uAC14\uB2E4\uAC00 \uC885\uC885 \uBAA8\uB974\uB294 \uC5EC\uD58F\uB4E4\uACFC \uB9C8\uC8FC\uCCD0 \uD568\uAED8 \uC0E4\uC6CC\uB97C \uD558\uAE30\uB3C4.",
