  "text" : "[\uAD70\uB300\uAD34\uB2F4 19] 2\uC7781\uC2E4\uC774\uB77C \uD558\uB354\uB77C\uB3C4 \uBC29\uC774 \uAF64 \uB113\uC740 \uD3B8\uC774\uACE0, \uC637\uC7A5 \uB4F1\uC73C\uB85C \uD30C\uD2F0\uC158\uC744 \uC0BC\uAE30 \uB54C\uBB38\uC5D0 \uB098\uB984 \uAC1C\uC778\uACF5\uAC04 \uD655\uBCF4\uAC00 \uB418\uB294 \uD3B8. (\uC544\uB2C8\uBA74 2\uC7781\uC2E4\uC774\uB418 \uC695\uC2E4\uACFC \uD654\uC7A5\uC2E4, \uC8FC\uBC29 \uB4F1\uB9CC \uAC19\uC774 \uC4F0\uACE0, \uCE68\uC2E4 \uB4F1\uC758 \uAC1C\uC778\uC0DD\uD65C\uACF5\uAC04\uC740 \uBCBD\uC73C\uB85C \uB098\uB258\uC5B4\uC838 \uC788\uB294 \uBC30\uB7ED\uB4E4\uB3C4 \uC788\uC74C)",
