  "text" : "[\uAD70\uB300\uAD34\uB2F4 16] \uB098\uB3C4 \uCE74\uD22C\uC0AC\uB85C\uC11C 22\uAC1C\uC6D4\uB3D9\uC548 \uAD70\uBCF5\uBB34\uB97C \uD588\uC9C0\uB9CC, \uC18C\uC18D\uBD80\uB300\uC5D0 \uAD00\uD55C \uAD70\uB300\uAD34\uB2F4\uC744 \uD55C\uBC88\uB3C4 \uB4E4\uC5B4\uBCF8 \uC801\uC774 \uC5C6\uC74C. \uC788\uC5B4\uBD24\uC790 \uD55C\uBC24\uC911\uC5D0 \uD558\uC580 \uC774\uC640 \uB208\uC54C \uB450\uAC1C\uB9CC \uB3D9\uB3D9 \uB5A0\uB2E4\uB154\uB2E4\uB294 \uAD34\uB2F4(\uBC24\uC911\uC5D0 \uB3CC\uC544\uB2E4\uB2C8\uB294 \uD751\uD615\uB4E4)\uC774\uB77C\uAC70\uB098, \uC0E4\uC6CC\uD558\uB2E4\uAC00 \uAE40\uBC25\uC744 \uBD24\uB2E4\uB294 \uAD34\uB2F4\uC815\uB3C4?",
