  "text" : "[\uAD70\uB300\uAD34\uB2F4 15] \uC8FC\uBCC0 \uC0AC\uB78C\uB4E4\uC758 \uC774\uC57C\uAE30\uB97C \uB4E4\uC5B4\uBCF4\uBA74 \uB2E4\uB4E4 \uAD70\uBCF5\uBB34 \uB2F9\uC2DC \uC18C\uC18D\uBD80\uB300\uB9C8\uB2E4 \uAD70\uB300\uAD34\uB2F4(\uB300\uBD80\uBD84 \uBD88\uCE68\uBC88\uC774\uB098 \uC57C\uAC04\uACBD\uACC4\uADFC\uBB34\uC640 \uAD00\uB828\uB41C \uADC0\uC2E0 \uC774\uC57C\uAE30)\uC774 \uC801\uC5B4\uB3C4 \uD558\uB098 \uC774\uC0C1\uC740 \uAF2D \uC788\uB2E4\uB294 \uAC83 \uAC19\uC740\uB370, \uBD88\uCE68\uBC88\uC774\uB098 \uC57C\uAC04\uACBD\uACC4\uADFC\uBB34\uAC00 \uC5C6\uB294 \uBBF8\uAD70\uACFC \uCE74\uD22C\uC0AC\uB294 \uAD70\uB300\uAD34\uB2F4\uC774 \uC5C6\uC74C;",
