  "text" : "[\uAD70\uB300\uAD34\uB2F4 14] \uC5EC\uD2BC.. \uAD6D\uBC29\uBD80\uB294 \uD55C\uBBF8\uC5F0\uD569\uD6C8\uB828\uC744 \uC704\uD574 \uD55C\uAD6D\uAD70\uC744 \uBBF8\uAD70\uBD80\uB300\uC5D0 \uD30C\uACAC\uD558\uAE30 \uC804\uC5D0 \uAC04\uBD80\uB4E4\uC5D0\uAC8C \uC608\uC808\uAD50\uC721\uACFC \uC9C8\uC11C\uAD50\uC721\uC744 \uCCA0\uC800\uD558\uAC8C \uC8FC\uC785\uC2DC\uD0AC \uD544\uC694\uAC00 \uC788\uC74C. \uD30C\uACAC\uB098\uC624\uAE30 \uC804\uC5D0 \uCD5C\uC18C\uD55C \uB3D9\uB9F9\uAD6D\uC758 \uACC4\uAE09\uC7A5 \uC77D\uB294 \uBC95 \uC815\uB3C4\uB294 \uBC30\uC6B0\uACE0 \uC640\uC57C \uD558\uB294\uAC70 \uC544\uB2D8? \uACBD\uB840\uB97C \uC548\uD574..",
