  "text" : "[\uAD70\uB300\uAD34\uB2F4 13] \uD30C\uACAC\uB098\uC628 \uD55C\uAD6D\uAD70 \uAC04\uBD80 \uC0C1\uB2F9\uC218\uB294 \uBBF8\uAD70\uC2DD\uB2F9 \uC785\uAD6C\uC5D0 '\uC2E4\uB0B4\uC5D0\uC11C\uB294 \uD734\uB300\uD3F0\uC744 \uC0AC\uC6A9\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4' \uB780 \uBB38\uAD6C\uAC00 \uD07C\uC9C0\uB9C9\uD558\uAC8C \uC368\uC788\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC904\uAE30\uCC28\uAC8C \uD734\uB300\uD3F0\uC73C\uB85C \uD1B5\uD654\uB97C \uD55C\uB2E4. \uC124\uB9C8 \uC601\uC5B4\uB97C \uBABB\uC77D\uB294\uAC74\uAC00.. \uADF8\uB798\uB3C4 \uB098\uB984 \uC721\uC0AC\uACF5\uC0AC\uD574\uC0AC \uB098\uC624\uC9C0 \uC54A\uC558\uC5B4\uC694?",
