  "text" : "[\uAD70\uB300\uAD34\uB2F4 10] \uADF8 \uD55C\uAD6D\uAD70 \uB300\uB839\uC774 \uB09C\uB3D9\uBD80\uB9AC\uB358 \uD55C\uAD6D\uAD70 \uC7A5\uAD50\uB4E4(\uC18C\uB8392,\uB300\uC7042)\uC5D0\uAC8C \"\uC57C\uC774 \uC0C8\uB07C\uB4E4\uC544, \uB2C8\uB4E4 \uBB50\uD558\uB294 \uB188\uB4E4\uC774\uC57C? \uB2C8\uB4E4 \uC8FD\uC5B4\uBCFC\uB798\" \uB77C\uBA70 \uC73C\uB974\uB801\uB300\uAE30 \uC2DC\uC791\uD558\uC790 \uB09C\uB3D9\uBD80\uB9AC\uB358 \uD55C\uAD6D\uAD70 \uC7A5\uAD50\uB4E4\uC740 \uACBD\uB840\uB3C4 \uC0DD\uB7B5\uD558\uACE0\uC120 \uBD80\uB300\uD328\uCE58\uB97C \uAC00\uB9B0 \uCC44 \uC5B4\uB514\uB860\uAC00 \uAE09\uD788 \uB3C4\uB9DD\uCCD0\uBC84\uB9BC",
