  "text" : "[\uAD70\uB300\uAD34\uB2F4 8] \uBBF8\uAD70\uB4E4\uC774\uC57C \uBB50 \uD55C\uAD6D\uAD70 \uAC04\uBD80\uB294 \uB3D9\uB9F9\uAD6D \uAC04\uBD80\uB4E4\uC774\uB2C8\uAE4C \uBB50\uB77C\uACE0 \uB9D0\uC744 \uC548\uD558\uC9C0\uB9CC \uD788\uC8FD\uD788\uC8FD \uBE44\uC6C3\uACE0 \uC788\uACE0, \uCE74\uD22C\uC0AC\uB4E4\uC740 \uACC4\uAE09\uC774 \uB538\uB9AC\uB2C8\uAE4C \uBB50\uB77C\uACE0 \uB9D0\uC744 \uBABB\uD558\uACE0.. \uD55C\uBBF8\uC5F0\uD569\uC0AC\uC758 \uD55C\uAD6D\uAD70 \uBD80\uC0AC\uAD00 \uD55C\uBA85\uC774 \uCC38\uB2E4\uBABB\uD574 \uADF8 \uD55C\uAD6D\uAD70 \uC7A5\uAD50\uB4E4\uC5D0\uAC8C \uB4A4\uC5D0 \uAC00\uC11C \uC904\uC744 \uC11C\uB77C\uACE0 \uC9C0\uC801",
