  "text" : "[\uAD70\uB300\uAD34\uB2F4 7] \uC77C\uBD80 \uADF8\uB7F0 \uD55C\uAD6D\uAD70 \uAC04\uBD80\uB4E4\uC740 \uC2EC\uC9C0\uC5B4\uB294 \uCC9C\uC5F0\uB355\uC2A4\uB7FD\uAC8C \uC0C8\uCE58\uAE30\uB97C \uD558\uAE30\uB3C4. \uADF8\uB7EC\uBA74 \uADF8 \uCABD\uD314\uB9BC\uC740 \uADF8 \uC904\uC5D0 \uC11C\uC788\uB358 \uCE74\uD22C\uC0AC\uB4E4\uC758 \uBAAB. \uC8FC\uBCC0\uC758 \uBBF8\uAD70\uB4E4\uC774 \"\uC57C, \uC7E4\uB4E4 \uB2C8\uB124 \uD55C\uAD6D\uAD70 \uAC04\uBD80\uB4E4 \uC544\uB2C8\uB0D0? \uBB50\uC57C \uC800 \uBCD1\uC2E0\uB4E4\uC740?!\" \uC774\uB7EC\uBA74 \uC5B4\uCC0C\uB098 \uBD80\uB044\uB7FD\uACE0 \uCABD\uD314\uB9AC\uB358\uC9C0..",
