  "text" : "\uBCC4 \uC0DD\uAC01 \uC5C6\uC774 \uADF8\uB7F0 \uBD84\uB4E4\uC5D0\uAC8C \uB9DE\uD314 \uB9FA\uC5C8\uB2E4\uAC00 \uC2DC\uB3C4\uB54C\uB3C4 \uC5C6\uC774 \uC62C\uB77C\uC624\uB294 (ad) \uB54C\uBB38\uC5D0 \uC9DC\uC99D\uB098\uC11C \uC5B8\uD314\uC744 \uD558\uBA74, \uB2E4\uC74C\uB0A0\uC774\uBA74 \uC584\uC9E4\uC5C6\uC774 \uC5B8\uD314\uC744 \uD588\uB354\uB77C\uACE0. \uB2C8\uB294 \uB0B4 \uD0C0\uC784\uB77C\uC778\uC774 \uBCF4\uACE0 \uC2F6\uC5B4 \uC120\uD314\uC744 \uD55C\uAC70\uB0D0, \uC544\uB2C8\uBA74 \uB9DE\uD314\uD574\uC11C \uB2C8 \uAE00\uC744 \uBCF4\uB3C4\uB85D \uC720\uB3C4\uD558\uAE30 \uC704\uD574 \uC120\uD314\uC744 \uD55C\uAC70\uB0D0.",
