  "text" : "\uC9C4\uC815\uD55C \uBC94\uC8C4\uC608\uBC29\uC740 \uC794\uD639\uD55C \uD615\uBC8C\uACFC \uC911\uD55C \uD615\uBC8C\uB85C \uC774\uB8E8\uC5B4\uC9C0\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C- \uB204\uAD6C\uB098 \uB611\uAC19\uC774, \uADF8\uB9AC\uACE0 \uBC18\uB4DC\uC2DC \uCC98\uBC8C\uBC1B\uAC8C \uB420 \uAC83\uC774\uB77C\uB294 \uC778\uC2DD\uC744 \uD1B5\uD574\uC11C\uB9CC \uC774\uB8E8\uC5B4 \uC9C8 \uC218 \uC788\uC5B4\uC694. \uC815\uC791 \uC790\uAE30\uB4E4\uC740 \uB2E4 \uD53C\uD574\uB098\uAC00\uBA74\uC11C, \uAD6D\uBBFC\uB4E4\uC5D0\uAC8C\uB294 \uC900\uBC95\uC815\uC2E0\uC744 \uC694\uAD6C\uD560 \uC218 \uC788\uACA0\uC5B4\uC694? \uC6C3\uAE30\uB294 \uC18C\uB9AC\uC9C0",
