  "text" : "\uBB50.. \uBC94\uC8C4\uB97C \uC800\uC9C0\uB978 \uBC95\uC870\uC778\uB4E4\uBD80\uD130 \uBC95\uB9DD\uC744 \uC0B4\uC0B4 \uBE60\uC838 \uB098\uC628\uB2E4\uB358\uAC00, \uC544\uB2C8\uBA74 \uC19C\uBC29\uB9DD\uC774 \uCC98\uBC8C\uC744 \uBC1B\uB294 \uAC83\uC774 \uD604\uC2E4\uC774\uAE34 \uD558\uC8E0. \uCC38\uACE0\uB85C \uB85C\uB9C8\uC5D0\uC11C\uB294 \uBD80\uC815\uC744 \uC800\uC9C0\uB978 \uD310\uC0AC\uB294 \uC0AC\uD615\uC5D0 \uCC98\uD588\uC2B5\uB2C8\uB2E4. \uADF8 \uB204\uAD6C\uBCF4\uB2E4 \uD0C0\uC758 \uBAA8\uBC94\uC774 \uB418\uC5B4\uC57C \uD558\uB294 \uC0AC\uB78C\uC774\uB77C\uB294 \uAC83\uC774 \uADF8 \uC774\uC720\uC600\uC8E0. \uC584\uC9E4\uC5C6\uC5B4\uC694",
