  "text" : "\uADF8\uB7F0 \uC774\uC720\uB85C.. \uADF9\uD615\uC744 \uB3C4\uC785\uD558\uC790\uAC70\uB098 \uD615\uB7C9\uC744 \uB298\uB9AC\uC790\uACE0\uB9CC \uD558\uB294 \uC694\uC998 \uC0AC\uD68C \uBD84\uC704\uAE30\uB294 \uADF8\uB2E4\uC9C0 \uB9D8\uC5D0 \uB4E4\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uADF8\uBCF4\uB2E4\uB294 \uBC94\uC8C4\uB97C \uC800\uC9C0\uB978 \uAD8C\uB825\uC790\uB098 \uC7AC\uB825\uAC00\uB4E4\uC5D0\uAC8C \uD2B9\uD61C \uC5C6\uB294 \uACF5\uC815\uD55C \uCC98\uBC8C\uC744 \uAC00\uD558\uB3C4\uB85D \uC694\uAD6C\uD558\uB294 \uAC83\uC774 \uC6B0\uC120\uB418\uC5B4\uC57C  \uD558\uC9C0 \uC54A\uC744\uAE4C\uC694.",
