  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uD615\uBC8C\uC758 \uBAA9\uC801 \uC911\uC5D0\uC11C \uBC94\uC8C4 \uC790\uCCB4\uB97C \uC800\uC9C0\uB974\uC9C0 \uBABB\uD558\uAC8C \uD558\uB824\uB294 \uC77C\uBC18\uC608\uBC29\uC744 \uAC00\uC7A5 \uC911\uC694\uD558\uAC8C \uC5EC\uAE41\uB2C8\uB2E4. \uBB3C\uB860 \uBC94\uC8C4\uC778\uC5D0\uAC8C \uC8D7\uAC12\uC744 \uCE58\uB8E8\uAC8C \uD558\uACE0 \uAD50\uD654\uC2DC\uD0A4\uB294 \uAC83\uB3C4 \uC911\uC694\uD558\uC9C0\uB9CC, \uADF8\uBCF4\uB2E4\uB294 \uCC98\uC74C\uBD80\uD130 \uBC94\uC8C4\uC778\uC774 \uB418\uC9C0 \uC54A\uB3C4\uB85D \uC774\uB044\uB294 \uAC83\uC774 \uB354 \uC911\uC694\uD558\uC9C0 \uC54A\uACA0\uC5B4\uC694?",
