  "text" : "\uC774\uB7F0 \uC2DD\uC73C\uB85C \uBC94\uC8C4\uC758 \uBC1C\uC0DD \uACFC\uC815\uC774\uB098 \uADF8\uC5D0 \uB530\uB978 \uD615\uBC8C\uC758 \uD6A8\uACFC \uB4F1\uC744 \uD0D0\uAD6C\uD558\uC5EC \uBC94\uC8C4\uD604\uC0C1\uC5D0 \uB2A5\uB3D9\uC801\uC73C\uB85C \uB300\uCC98\uD558\uACE0, \uBC94\uC8C4\uB85C\uBD80\uD130 \uC0AC\uD68C\uB97C \uD6A8\uACFC\uC801\uC73C\uB85C \uBC29\uC5B4\uD558\uAE30 \uC704\uD55C \uBC29\uBC95 \uB4F1\uC744 \uD0D0\uAD6C\uD558\uB294 \uD559\uBB38\uC744 '\uD615\uC0AC\uC815\uCC45\uD559' \uC774\uB77C\uACE0 \uBD80\uB985\uB2C8\uB2E4.",
