  "text" : "\uD558\uC9C0\uB9CC \uC220\uC9D1\uACE8\uBAA9 \uBC14\uB85C \uC55E\uC5D0\uC11C \uC74C\uC8FC\uB2E8\uC18D\uC744 \uD558\uACE0 \uC788\uB294 \uBAA8\uC2B5\uC744 \uBCF4\uAC8C \uB418\uBA74 \uAC70\uC758 \uB300\uBD80\uBD84\uC758 \uC8FC\uCDE8\uC790\uB4E4\uC740 \uC74C\uC8FC\uC6B4\uC804\uC744 \uD3EC\uC2DC\uD558\uAC8C \uB429\uB2C8\uB2E4. '\uB0B4\uAC00 \uC5EC\uAE30\uC11C \uC74C\uC8FC\uC6B4\uC804\uC744 \uD558\uAC8C \uB418\uBA74 \uBC18\uB4DC\uC2DC \uC801\uBC1C\uB418\uC5B4 \uCC98\uBC8C\uBC1B\uB294\uB2E4' \uB77C\uACE0 \uC778\uC2DD\uD558\uAC8C \uB418\uAE30 \uB54C\uBB38\uC774\uC8E0.",
