  "text" : "\uC220\uB9C8\uC2E0 \uC0AC\uB78C\uC774 '\uB098\uB294 \uBC18\uB4DC\uC2DC \uC801\uBC1C\uB418\uC5B4 \uCC98\uBC8C \uBC1B\uC744\uAEBC\uC57C' \uB77C\uACE0 \uC0DD\uAC01\uD558\uBA70 \uC74C\uC8FC\uC6B4\uC804 \uD558\uB294\uAC70 \uBCF4\uC168\uB098\uC694. \uB2E4\uB4E4 \uC790\uAE30\uB294 \uB2E8\uC18D\uC744 \uD53C\uD560 \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uBA70 \uC74C\uC8FC\uC6B4\uC804\uC744 \uD558\uC8E0. \uADF8\uBD84\uB4E4\uC5D0\uAC90 \uC74C\uC8FC\uC6B4\uC804 \uC0AC\uACE0\uC790\uB8CC\uB97C \uBCF4\uC5EC\uC918\uB3C4 \uBCC4\uB2E4\uB978 \uAC10\uD765\uC774 \uC5C6\uC5B4\uC694. \uC0AC\uACE0\uB3C4 \uC548\uB0BC \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uB2C8\uAE4C.",
