  "text" : "\uC624\uB9C8\uBD84\uC2DC, \uB2A5\uC9C0\uCC98\uCC38 \uB4F1\uC758 \uADF9\uD615\uC774 \uC788\uB358 \uC2DC\uC808\uC5D0\uB3C4 \uBC18\uC5ED\uC744 \uD560 \uB188\uC740 \uBC18\uC5ED\uC744 \uD588\uC5B4\uC694. \uADF8 \uC774\uC720\uB294 \uBC94\uC8C4\uC790\uAC00 \uBC94\uD589\uC744 \uACB0\uC758\uD558\uACE0 \uC774\uB97C \uC2E4\uD589\uD560 \uB54C, \uC790\uC2E0\uC774 \uBC1C\uAC01\uB418\uC5B4 \uCC98\uBC8C\uBC1B\uC744 \uAC83\uC774\uB780 \uC0DD\uAC01\uC744 \uD558\uACE0 \uBC94\uD589\uC744 \uC800\uC9C0\uB974\uC9C4 \uC54A\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uAC70\uC758 \uBAA8\uB4E0 \uBC94\uC8C4\uC790\uAC00 \uC644\uC804\uBC94\uC8C4\uB97C \uAFC8\uAFB8\uC8E0.",
