  "text" : "\uADF8\uB798\uB193\uACE0\uC120 '\uC790\uAE30\uAC00 \uC624\uB7AB\uB3D9\uC548 \uC0AC\uADC0\uC5B4\uC628 \uB0A8\uC790\uCE5C\uAD6C\uB97C \uBC84\uB9AC\uACE0 \uBC14\uB78C\uC744 \uD3C8\uB294\uB370, \uADF8\uB3D9\uC548 \uB0A8\uC790\uB294 \uAFB9 \uCC38\uACE0 \uACF5\uBD80\uD574\uC11C \uD589\uC2DC\uB97C \uD328\uC2A4\uD588\uB2E4. \uADF8\uB9AC\uACE0\uB294 \uB2E4\uC2DC \uB098\uB97C \uBC1B\uC544\uC8FC\uC5C8\uB2E4.' \uB530\uC704\uC758 \uAE00\uC5D0\uB2E4\uAC00 '\uC640.. \uADF8\uB0A8\uC790 \uBA4B\uC788\uB2E4.. \uC815\uB9D0 \uBC97\uB2D8\uC744 \uC0AC\uB791\uD588\uB098\uBD10..' \uB530\uC704 \uB313\uAE00\uC774\uB098 \uB2EC\uACE0 \uC788\uACE0",
