  "text" : "\uB0B4\uAC00 \uC785\uCC3D\uD588\uB358 \uCCAB\uB0A0, \uAF2C\uB9AC\uACF0\uD0D5\uC774 \uB098\uC654\uAE38\uB798 '\uD55C\uAD6D\uAD70 \uC9EC\uBC25\uC774 \uC544\uC8FC \uAD1C\uCC2E\uAD6C\uB9CC!!' \uC774\uB77C\uACE0 \uC0DD\uAC01\uD588\uC5C8\uB2E4. \uB2E4\uC74C\uB0A0\uBD80\uD130\uB294 \uC880 \uBCC4\uB85C\uC778 \uC2DD\uB2E8\uC774 \uACC4\uC18D\uB418\uC5C8\uB358 \uAC83\uC774 \uD568\uC815\uC774\uAE34 \uD588\uC9C0\uB9CC.. \uAD70\uB370\uB9AC\uC544\uB3C4 \uAD1C\uCC2E\uC558\uC5B4. \uC0B6\uC740\uACC4\uB780\uC774\uB791 \uC591\uBC30\uCD94\uC0D0\uB7EC\uB4DC\uB97C \uD328\uD2F0\uC5D0 \uC2A5\uC2A5 \uBC1C\uB77C \uC6B0\uC720\uC640 \uD568\uAED8 \uC640\uAD6C\uC640\uAD6C-",
