  "text" : "\uADF8\uB798\uC11C \uD55C\uBC88\uC740 \uBE44\uBABD\uC0AC\uBABD\uD55C \uC0C1\uD0DC\uC5D0\uC11C \uC790\uCD08\uC9C0\uC885\uC744 \uC124\uBA85\uD558\uACE0 DVD\uBC29\uC744 \uB4E4\uC5B4\uAC14\uB2E4. \uADF8\uB9AC\uACE0 \uBCF4\uACE0\uC2F6\uC740 \uC601\uD654\uB97C \uBCF4\uB77C\uACE0 \uD55C \uB4A4 \uB098\uB294 \uADF8\uB300\uB85C \uAE30\uC808- \uB300\uCDA9 \uD55C\uC2DC\uAC04 \uC815\uB3C4 \uD6C4\uC5D0 \uC815\uC2E0\uC744 \uCC28\uB824\uBCF4\uB2C8 \uBB34\uB98E\uC744 \uBCA0\uACE0 \uC788\uB354\uB77C. \uB108\uBB34 \uACE4\uD788 \uC790\uB294\uAC8C \uC548\uC4F0\uB7EC\uC6CC\uC11C \uBB34\uB98E\uBCA0\uAC1C\uB97C \uD574\uC92C\uB2E4\uACF8\u314B\u314B\u314B\u314B\u314B\u314B",
