  "text" : "\uC798 \uBAA8\uB974\uB294 \uC0AC\uB78C\uC5D0\uAC8C \uB300\uB738 '\uB098 \uC878\uB824\uC11C \uC790\uB7EC \uAC00\uC57C \uD574\uC694-' \uB77C\uBA70 \uC57D\uC18D\uC744 \uAE09 \uD30C\uAE30 \uD55C\uB2E4\uAC70\uB098, '\uB098 \uC880 \uC790\uACE0\uAC08\uB798\uC694. TV\uB77C\uB3C4 \uBCF4\uACE0 \uC788\uC5B4\uC694' \uB77C\uBA70 \uD568\uAED8 \uBAA8\uD154\uC744 \uB4E4\uC5B4\uAC08\uC218\uB3C4 \uC5C6\uB294 \uB178\uB987\uC774\uACF8\u314B\u314B\u314B\u314B\u314B\u314B \uADF8\uB807\uB2E4\uACE0 \uCE74\uD398\uC5D0\uC11C \uBD88\uD3B8\uD558\uAC8C \uC5CE\uB4DC\uB824 \uC790\uB294\uAC74 \uC548\uC790\uB290\uB2C8\uB9CC \uBABB\uD558\uACE0..",
