  "text" : "\uC9D1\uC5D0\uC11C\uB77C\uBA74 \uB2F9\uC5F0\uD788 \uC774\uBD88 \uAE54\uACE0 \uC790\uBA74 \uB418\uACA0\uC9C0\uB9CC, \uBB38\uC81C\uB294 \uC9D1 \uBC16\uC5D0\uC11C \uC7A0\uC774 \uC3DF\uC544\uC9C0\uB294 \uACBD\uC6B0\uB2E4. \uADF8\uB7F4\uB54C\uB294 \uC815\uB9D0 \uD544\uC0AC\uC801\uC73C\uB85C \uC7A0\uC798 \uACF3\uC744 \uCC3E\uC544 \uD5E4\uB9E4\uC774\uAC8C \uB418\uB294\uB370, \uBCF4\uD1B5\uC740 \uBAA8\uD154 \uAC19\uC740 \uACF3\uC5D0 \uB4E4\uC5B4\uAC00\uC11C \uBED7\uC5B4 \uC790\uACE4 \uD55C\uB2E4. \uADFC\uB370 \uC798 \uBAA8\uB974\uB294 \uC0AC\uB78C\uACFC \uD568\uAED8 \uC788\uC744 \uB550 \uC815\uB9D0 \uB2F5\uC774 \uC5C6\uC5B4..",
