  "text" : "\uD5CC\uBC95\uC7AC\uD310\uC18C\uB294 \uC74C\uB780\uC744 \"\uC778\uAC04\uC874\uC5C4 \uB0B4\uC9C0 \uC778\uAC04\uC131\uC744 \uC65C\uACE1\uD558\uB294 \uB178\uACE8\uC801\uC774\uACE0 \uC801\uB098\uB77C\uD55C \uC131\uD45C\uD604\uC73C\uB85C\uC11C \uC624\uB85C\uC9C0 \uC131\uC801 \uD765\uBBF8\uC5D0\uB9CC \uD638\uC18C\uD560 \uBFD0 \uC804\uCCB4\uC801\uC73C\uB85C \uBCF4\uC544 \uD558\uB4F1\uC758 \uBB38\uD559\uC801, \uC608\uC220\uC801, \uACFC\uD559\uC801 \uB610\uB294 \uC815\uCE58\uC801 \uAC00\uCE58\uB97C \uC9C0\uB2C8\uC9C0 \uC54A\uC740 \uAC83.\" \uC774\uB77C\uACE0 \uC815\uC758\uD558\uACE0 \uC788\uC5B4\uC694.",
