  "text" : "\uADF8\uB7EC\uC790 \uADF8\uB140\uAC00 \uC6C3\uC73C\uBA74\uC11C \uADF8\uB7FC \uB0B4\uC77C\uB3C4 \uAC19\uC774 \uC190\uC7A1\uACE0 \uAC78\uC5B4\uB2E4\uB2C8\uBA74 \uB418\uB2C8\uAE4C \uAC10\uAE30\uAC78\uB9AC\uC9C0 \uB9D0\uACE0 \uBE68\uB9AC \uC9D1\uC5D0 \uB4E4\uC5B4\uAC00\uB77C\uACE0, \uB9CC\uC57D\uC5D0 \uAC10\uAE30 \uAC78\uB9AC\uBA74 \uC548\uBCFC\uAEBC\uB77C\uACE0 \uD588\uB2E4. \uADF8\uB807\uAC8C \uC0AC\uADC0\uAE30 \uC2DC\uC791\uD588\uB358\uAC8C \uB0B4\uAC00 \uAE30\uC5B5\uD558\uB294 \uAC00\uC7A5 \uB2EC\uB2EC\uD55C \uC5F0\uC560 \uC624\uD504\uB2DD.",
