  "text" : "\uADF8\uB7AC\uB354\uB2C8 \uADF8\uB140\uAC00 \uC65C \uADF8\uAC78 \uC774 \uCD94\uC6B4 \uB0A0\uC528\uC5D0 \uAE38\uAC70\uB9AC\uB97C \uAC78\uC73C\uBA74\uC11C \uC0DD\uAC01\uD558\uACE0 \uC788\uB0D0\uACE0 \uBB3C\uC5B4\uC654\uB2E4. \uADF8\uB798\uC11C \uC544\uAE4C \uC190\uC7A1\uACE0 \uD568\uAED8 \uAC78\uC5C8\uB358 \uAC83\uC758 \uC5EC\uC6B4\uC774 \uB0A8\uC544\uC11C, \uADF8\uAC8C \uBB54\uAC00 \uC544\uC26C\uC6CC\uC11C \uB098\uB3C4 \uBAA8\uB974\uAC8C \uACC4\uC18D \uAC77\uACE0 \uC788\uC5C8\uB358 \uAC83\uC774\uB77C\uACE0 \uB300\uB2F5\uD588\uB2E4.",
