  "id_str" : "287646201858383872",
  "text" : "\uC65C \uC544\uC9C1\uAE4C\uC9C0 \uC9D1\uC5D0 \uC548\uB4E4\uC5B4\uAC00\uACE0 \uC788\uB0D0\uACE0 \uAC71\uC815\uD558\uAE38\uB798, \uC0DD\uAC01\uD560\uAC8C \uC880 \uC788\uC5B4\uC11C \uAC77\uACE0 \uC788\uB294 \uC911\uC774\uB77C\uACE0 \uB300\uB2F5\uD588\uB2E4. \uADF8\uB7AC\uB354\uB2C8 \uBB34\uC2A8 \uC0DD\uAC01\uC744 \uD558\uACE0 \uC788\uB0D0\uACE0 \uBB3C\uC5B4\uBCF4\uAE38\uB798 \uC7A0\uAE50 \uC8FC\uC800\uD558\uB2E4\uAC00, \"\uC608\uC804\uBD80\uD130 \uC88B\uC544\uD588\uC5C8\uB2E4. \uADF8\uB798\uC11C \uC0AC\uADC0\uC790\uB294 \uB9D0\uC744 \uC5B4\uB5BB\uAC8C \uAEBC\uB0BC\uAE4C \uACE0\uBBFC\uC911\" \uC774\uB77C\uACE0 \uB300\uB2F5.",
