  "id_str" : "287645245510909954",
  "text" : "\uC11C\uC6B8\uB85C \uB3CC\uC544\uC640 \uADF8\uB140\uB97C \uC9D1\uC5D0 \uBC14\uB798\uB2E4\uC8FC\uACE0, \uB098\uB294 \uBB54\uAC00 \uC5EC\uC6B4\uC5D0 \uCDE8\uD574 \uADF8\uB300\uB85C \uAC77\uAE30 \uC2DC\uC791\uD588\uB2E4. \uD55C\uAC15\uC744 \uAC74\uB108 \uC6A9\uC0B0\uC744 \uC9C0\uB098\uACE0 \uC11C\uC6B8\uC9C0\uBC29\uACBD\uCC30\uCCAD \uADFC\uCC98\uAE4C\uC9C0 \uC654\uB294\uB370, \uADF8\uB140\uC5D0\uAC8C\uC11C \uCD94\uC6B4\uB370 \uC9D1\uC5D0 \uC798 \uB4E4\uC5B4\uAC14\uB0D0\uBA70 \uC804\uD654\uAC00 \uC654\uB2E4. \uADF8\uB798\uC11C \uC9D1\uC774\uB77C\uACE0 \uD588\uB294\uB370, \uB35C\uB35C \uB5A0\uB294 \uBAA9\uC18C\uB9AC \uB54C\uBB38\uC5D0 \uD0C4\uB85C",
