  "text" : "\uB8E8\uBBF8\uB098\uB9AC\uC5D0\uB97C \uBCF4\uACE0 \uB3CC\uC544\uC624\uB294\uB370, \uADF8\uB0A0\uB530\uB77C \uB0A0\uC528\uAC00 \uB108\uBB34 \uCD94\uC6E0\uC5C8\uB2E4. \uAC8C\uB2E4\uAC00 \uBD80\uCC9C\uC758 \uB8E8\uBBF8\uB098\uB9AC\uC5D0 \uD589\uC0AC\uC7A5\uC740 \uD5C8\uD5C8\uBC8C\uD310.. \uC785\uC220\uC774 \uC0C8\uD30C\uB798\uC9C4 \uADF8\uB140\uB97C \uBCF4\uAE30\uAC00 \uC548\uC4F0\uB7EC\uC6CC\uC11C \uB0B4 \uBAA9\uB3C4\uB9AC\uB85C \uC5BC\uAD74\uC744 \uAC10\uC2F8\uC8FC\uACE0, \uC5BC\uC5B4\uBD99\uC740 \uC190\uC744 \uC7A1\uC544 \uB0B4 \uC8FC\uBA38\uB2C8\uC5D0 \uB123\uC5C8\uB2E4. \uADF8\uB9AC\uACE0\uB294 \uBB35\uBB35\uD788 \uAC78\uC5C8\uC5C8\uC9C0.",
