  "text" : "\uADF8\uB798\uC11C \uB0B4\uAC00 \uC804\uD654\uB85C \uAE68\uC6CC\uC904\uD14C\uB2C8 \uAC71\uC815\uB9D0\uACE0 \uC790\uB77C\uACE0 \uB2E4\uB3C5\uC774\uBA70 \uC804\uD654\uB97C \uB04A\uC5C8\uACE0, \uB450\uC2DC\uAC04 \uD6C4\uC5D0 \uBAA8\uB2DD\uCF5C\uC744 \uD588\uB2E4. \uADF8\uB9AC\uACE0\uB294 \uC7A0\uAE50 \uB208\uC744 \uBD99\uC600\uB294\uB370, \uC810\uC2EC\uB54C\uCBE4 \uB418\uB2C8 \uBCFC\uC77C\uC774 \uB05D\uB0AC\uB2E4\uB294 \uBB38\uC790\uAC00 \uC654\uB2E4. \uADF8\uB798\uC11C \uC810\uC2EC\uC740 \uBA39\uC5C8\uB0D0\uACE0 \uBB3C\uC5B4\uBD24\uB354\uB2C8 \uC544\uC9C1 \uBABB\uBA39\uC5C8\uB2E4\uACE0..",
