  "text" : "\uADF8\uB7AC\uB294\uB370 \uC7A0\uC774 \uC548\uC628\uB2E4\uBA70 \uB2F5\uBB38\uC774 \uC654\uB2E4. \uC7A0\uAE50 \uBB38\uC790\uC9C8\uC744 \uD558\uB2E4\uAC00 \uB2F5\uB2F5\uD574\uC11C \uC804\uD654- \uADF8\uB9AC\uACE0\uB294 \uB610 \uC0C8\uBCBD\uAE4C\uC9C0 \uD3ED\uD48D\uD1B5\uD654. \uAFB8\uBC85\uAFB8\uBC85 \uC878\uBA74\uC11C\uB3C4 \uC804\uD654\uB97C \uB04A\uC9C0 \uC54A\uC73C\uB824 \uD558\uB294 \uAC83\uC774 \uC548\uC4F0\uB7EC\uC6CC\uC11C, \uB0B4\uC77C \uB610 \uC804\uD654 \uD560\uD14C\uB2C8 \uB04A\uACE0 \uC790\uB77C\uACE0 \uD588\uB2E4. \uADF8\uB7AC\uB354\uB2C8 \uC544\uCE68 \uC77C\uCC0D \uC77C\uC5B4\uB0A0 \uC77C\uC774 \uC788\uB2E4\uACE0..",
