  "text" : "\uC0AC\uC9C4\uC744 \uAC74\uB124\uC900 \uB4A4 \uC774\uB7F0\uC800\uB7F0 \uC774\uC57C\uAE30\uB97C \uD558\uBA74\uC11C \uBC24 \uB2A6\uAC8C\uAE4C\uC9C0 \uBA54\uC2E0\uC800\uB85C \uB300\uD654\uB97C \uB098\uB234\uB294\uB370, \uC544\uC27D\uC9C0\uB9CC \uCEF4\uD4E8\uD130\uB97C \uAEBC\uC57C \uD55C\uB2E4\uBA70 \uC791\uBCC4\uC778\uC0AC\uB97C \uD574\uC654\uB2E4. \uADF8\uB798\uC11C \uC11C\uB85C\uC758 \uC804\uD654\uBC88\uD638\uB97C \uAD50\uD658\uD558\uACE0, \uC7A0\uC790\uB9AC\uC5D0 \uB204\uC6CC\uC11C '\uC798\uC790\uC694-' \uB77C\uACE0 \uBB38\uC790\uB97C \uBCF4\uB0C8\uC9C0.",
