  "text" : "\uADF8\uB9AC\uACE0\uB294 MSN \uBA54\uC2E0\uC800 \uC8FC\uC18C\uB97C \uC54C\uB824\uC8FC\uBA74\uC11C \uAF2D \uC0AC\uC9C4\uC744 \uBCF4\uB0B4\uB2EC\uB77C\uACE0.. \uADF8\uB807\uAC8C \uD5E4\uC5B4\uC9C4 \uB4A4 \uBA54\uC2E0\uC800\uC5D0 \uCD94\uAC00\uB9CC \uD574\uB193\uACE0\uC120 \uD55C \uC5F4\uD758 \uC815\uB3C4\uB97C \uBC14\uBE60\uC11C \uBA54\uC2E0\uC800\uC5D0 \uB4E4\uC5B4\uAC00\uC9C0\uB97C \uBABB\uD558\uB2E4\uAC00 \uB4E4\uC5B4\uAC14\uB354\uB2C8 \uADF8\uB140\uAC00 \uB098\uB97C \uAE30\uB2E4\uB9AC\uACE0 \uC788\uC5C8\uB2E4. \uC65C \uC774\uB807\uAC8C \uC624\uB798 \uAC78\uB838\uB0D0\uACE0 \uC7A0\uAE50 \uC794\uC18C\uB9AC\uB3C4 \uB4E3\uACE0.",
