  "text" : "\uADF8\uB798\uC11C \uD559\uC6D0\uC744 \uB2E4\uB2C8\uB294 \uB0B4\uB0B4 \uB9D0\uC744 \uBD99\uC5EC\uBCFC \uC218\uAC00 \uC5C6\uC5C8\uB2E4.. \uADF8\uB7EC\uB2E4\uAC00 \uC2DC\uD5D8\uC774 \uB05D\uB098\uACE0 \uC885\uC5C5\uC2DD\uB0A0, \uCE5C\uAD6C\uC640 \uD568\uAED8 \uC774\uC57C\uAE30\uB97C \uD558\uACE0 \uC788\uB358 \uC2EC\uB140\uC5D0\uAC8C \uB2E4\uAC00\uAC00 \"\uAC19\uC774 \uC0AC\uC9C4 \uCC0D\uC744\uB798\uC694?\" \uB77C\uACE0 \uBB3C\uC5B4\uBD24\uB2E4. \uADFC\uB370 \uADF8\uB140\uAC00 \uB108\uBB34\uB098 \uD754\uCF8C\uD788 \uC2B9\uB099\uD558\uBA74\uC11C \uD314\uC9F1\uC744 \uAEF4\uC654\uB2E4.",
