  "text" : "\uADF8\uB798\uB3C4 \uC0AC\uC2E4 \uC880 \uC544\uC27D\uC2B5\uB2C8\uB2E4. \uD574\uB2F9 \uD310\uACB0\uBB38\uC744 \uC77D\uC5B4\uBCF4\uBA74 \uD5CC\uC7AC\uB294 \uAC80\uCC30\uC5D0 \uB098\uB984 \uBE45\uC5FF\uC744 \uBA39\uC77C \uC900\uBE44\uB97C \uCC29\uCC29 \uD574\uB098\uAC00\uACE0 \uC788\uC5C8\uAC70\uB4E0\uC694. \uD5CC\uBC95\uC18C\uC6D0\uCCAD\uAD6C\uC778\uB2E8\uC774 \uCDE8\uD558\uD558\uC9C0\uB9CC \uC54A\uC558\uC5B4\uB3C4 \uD5CC\uC7AC\uAC00 \uAC80\uCC30\uC744 \uB514\uC2A4\uD558\uB294 \uC7AC\uBBF8\uC788\uB294 \uC0AC\uD0DC\uAC00 \uBC8C\uC5B4\uC84C\uC744 \uAC83 \uAC19\uC740\uB370..",
