  "text" : "\uADF8\uB7F0\uB370 \uCCAD\uAD6C\uC778\uB2E8\uC774 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC758 \uD310\uACB0 \uC9C1\uC804\uC5D0 \uD5CC\uBC95\uC18C\uC6D0\uC2EC\uD310\uCCAD\uAD6C\uB97C \uCDE8\uD558\uD574 \uBC84\uB9AC\uB294, \uC774\uD574 \uD560 \uC218 \uC5C6\uB294 \uB3CC\uBC1C\uD589\uB3D9\uC744 \uC790\uD589\uD574 \uBC84\uB838\uACE0.. \uD5CC\uBC95\uC7AC\uD310\uC18C\uB294 \"\uCCAD\uAD6C\uC778\uB4E4\uC774 \uD5CC\uBC95\uC18C\uC6D0\uC2EC\uD310\uCCAD\uAD6C\uB97C \uCDE8\uD558\uD558\uBA74 \uD5CC\uBC95\uC18C\uC6D0\uC2EC\uD310\uC808\uCC28\uB294 \uC885\uB8CC\uB41C\uB2E4\"\uB294 \uC6D0\uCE59\uC5D0 \uB530\uB77C \uCF00\uC774\uC2A4\uB97C \uB36E\uAC8C \uB429\uB2C8\uB2E4.",
