  "text" : "\uC774 \uBD88\uAE30\uC18C\uCC98\uBD84\uC758 \uC774\uC720\uAC00 \uCC38\uC73C\uB85C \uAC78\uC791\uC774\uC5C8\uC8E0. \uADF8 \uC720\uBA85\uD55C \"\uC131\uACF5\uD55C \uCFE0\uB370\uD0C0\uB294 \uCC98\uBC8C \uD560 \uC218 \uC5C6\uB2E4. \uC804\uB450\uD658\uACFC \uB178\uD0DC\uC6B0\uC758 \uCFE0\uB370\uD0C0\uB294 \uC131\uACF5\uD588\uC73C\uBBC0\uB85C, \uC774\uB4E4\uC758 \uB0B4\uB780\uD589\uC704\uB294 \uCC98\uBC8C\uD560 \uC218 \uC5C6\uC73C\uBBC0\uB85C \uC774\uB4E4\uC744 \uBD88\uAE30\uC18C\uD55C\uB2E4.\" \uB77C\uB294 \uC774 \uBC14\uB85C \uC5EC\uAE30\uC5D0\uC11C \uB4F1\uC7A5\uD569\uB2C8\uB2E4.",
