  "text" : "1994\uB144\uC5D0 \uC804\uB450\uD658, \uB178\uD0DC\uC6B0 \uB4F1 35\uBA85\uC774 '\uB0B4\uB780 \uBC0F \uB0B4\uB780\uBAA9\uC801 \uC0B4\uC778' \uD610\uC758\uB85C \uC11C\uC6B8\uC9C0\uAC80\uC5D0 \uACE0\uC18C\uB418\uC5C8\uC5C8\uB294\uB370, \uB2F9\uC2DC \uC11C\uC6B8\uC9C0\uAC80 \uACF5\uC5481\uBD80\uC7A5 \uAC80\uC0AC\uB85C\uC11C \uC774 \uC0AC\uAC74\uC758 \uC8FC\uC784\uAC80\uC0AC\uB97C \uB9E1\uC558\uB358 \uBAA8 \uC528(\uD604\uC7AC\uB294 \uBAA8\uC815\uB2F9\uC758 \uAD6D\uD68C\uC758\uC6D0\uC774\uC2ED\uB2C8\uB2E4)\uAED8\uC11C\uB294 \uC774 \uC0AC\uAC74\uC744 \uBD88\uAE30\uC18C \uCC98\uBD84\uD574 \uBC84\uB9BD\uB2C8\uB2E4.",
