  "text" : "[4. \uAD11\uBC94\uC704\uD55C \uB300\uC548\uC801 \uC758\uC0AC\uD1B5\uB85C\uB97C \uB9C8\uB828\uD574 \uB193\uC744 \uAC83] \uC608\uC678\uC801\uC73C\uB85C \uC81C\uD55C\uC744 \uAC00\uD558\uB354\uB77C\uB3C4- \uC9D1\uD68C \uCC38\uAC00\uC790\uAC00 \uD589\uC815\uC18C\uC1A1 \uB4F1\uC744 \uD1B5\uD574 \uC81C\uD55C\uC758 \uC704\uD5CC\uC131\uC744 \uB2E4\uD234 \uC218 \uC788\uB294 \uAE38\uC744 \uC5F4\uC5B4\uB193\uB294\uB2E4\uAC70\uB098, \uC544\uB2C8\uBA74 \uB2E4\uB978 \uBC29\uBC95\uC73C\uB85C \uADF8\uB4E4\uC758 \uC758\uC0AC\uB97C \uC804\uB2EC\uD560 \uC218 \uC788\uB294 \uAE30\uD68C\uB97C \uB9CC\uB4E4 \uAC83\uC744 \uC694\uAD6C\uD569\uB2C8\uB2E4.",
