  "text" : "\uB178\uB825\uC758 \uC815\uB3C4\uB97C \uD615\uB7C9\uD55C\uB2E4\uB294 \uAC83\uC774 \uBB34\uC758\uBBF8\uD558\uAE30\uB294 \uD558\uC9C0\uB9CC, \uC5B5\uC9C0\uB85C \uC7AC\uBCF4\uC790\uBA74.. \uC815\uC758\uB97C \uC2E4\uD604\uD558\uAE30 \uC704\uD574 \uD0C0 \uC9C1\uC5C5\uAD70\uB4E4\uC774 \uB4E4\uC774\uB294 \uB178\uB825\uC5D0 \uBE44\uD574, \uD310\uC0AC\uAC00 \uB4E4\uC774\uB294 \uB178\uB825\uC740 \uC0C1\uB300\uC801\uC73C\uB85C \uC880 \uC218\uC6D4(?)\uD558\uB2E4\uACE0 \uBD10\uB3C4 \uB420 \uAC83 \uAC19\uAE30\uB3C4 \uD558\uAD6C\uC694.",
