  "id_str" : "287259769729867776",
  "text" : "\uC5EC\uD2BC.. \uC138\uC0C1\uC744 \uBC14\uAFB8\uB294 \uB370\uC5D0\uB294 \uBC95\uB960\uAC00, \uADF8\uC911\uC5D0\uC11C\uB3C4 \uD2B9\uD788 \uD310\uC0AC\uB77C\uB294 \uC9C1\uC5C5\uB9CC\uD55C \uAC83\uC774 \uC5C6\uB2E4\uB294 \uC0DD\uAC01\uC740 \uC9C0\uAE08\uB3C4 \uBCC0\uD568\uC774 \uC5C6\uC2B5\uB2C8\uB2E4. \uC790\uC2E0\uC774 \uC0DD\uAC01\uD558\uB294 \uBD88\uC758\uB97C '\uD310\uACB0'\uC774\uB77C\uB294 \uAC15\uC81C\uB825\uC744 \uD1B5\uD574 \uD558\uB8E8\uC544\uCE68\uC5D0 '\uBD88\uBC95'\uC73C\uB85C \uC120\uC5B8 \uD560 \uC218 \uC788\uAC70\uB4E0\uC694.",
