  "text" : "\"\uAC15\uC790\uC640 \uC57D\uC790 \uAC04\uC758 \uC7AC\uD310\uC744 \uD560 \uB54C \uC5B4\uB290 \uCABD\uC5D0\uB3C4 \uAE30\uC6B8\uC9C0 \uC54A\uACA0\uB2E4\uACE0 \uD55C \uC7AC\uD310\uC740 \uC9C0\uAE08 \uC0DD\uAC01\uD574 \uBCF4\uBA74 \uAC15\uC790 \uCE21\uC5D0 \uAE30\uC6B4 \uC7AC\uD310\uC774\uC5C8\uACE0, \uC57D\uC790 \uCE21\uC5D0 \uC870\uAE08 \uAE30\uC6B8\uC5C8\uB2E4\uACE0 \uC0DD\uAC01\uD558\uBA70 \uD55C \uC7AC\uD310\uC740 \uC9C0\uAE08 \uC0DD\uAC01\uD574 \uBCF4\uBA74 \uC624\uD788\uB824 \uC911\uB9BD\uC801\uC774\uC5C8\uC74C\uC744 \uC54C\uAC8C \uB418\uC5C8\uB2E4.\" - \uBCA4\uC790\uBBFC \uCE74\uB3C4\uC870",
