  "text" : "\uBB3C\uB860 \uBC95\uB960\uAC00\uC758 \uC911\uB9BD\uC131\uC774\uB77C\uB294 \uAC83\uC774 \uD754\uD788 \uB9D0\uD558\uB294 '\uD53C\uB3C4 \uB208\uBB3C\uB3C4 \uC5C6\uB294 \uAE30\uACC4\uC801 \uC911\uB9BD'\uC744 \uB73B\uD558\uB294 \uAC83\uC740 \uC808\uB300 \uC544\uB2D9\uB2C8\uB2E4. \uADF8\uAC74 \uC815\uB9D0 \uBC95\uC744 \uC801\uC6A9\uD558\uB294 \uAE30\uACC4\uC77C \uBFD0\uC774\uC8E0. \uBC95\uB960\uAC00\uAC00 \uC9C0\uD5A5\uD558\uB294 '\uC911\uB9BD\uC131'\uC5D0 \uB300\uD55C \uC124\uBA85\uC740 \uBBF8 \uC5F0\uBC29\uB300\uBC95\uAD00\uC774\uC5C8\uB358 \uBCA4\uC790\uBBFC \uCE74\uB3C4\uC870\uC758 \uBA85\uC5B8\uC73C\uB85C \uB300\uCCB4\uD569\uB2C8\uB2E4.",
