  "text" : "\uBB50.. '\uC815\uC758'\uB97C \uBD80\uB974\uC9D6\uC73C\uBA70 \uC815\uCE58\uC801 \uACAC\uD574\uB97C \uACF5\uAC1C\uC801\uC73C\uB85C \uD53C\uB825\uD558\uB294 \uBC95\uB960\uAC00\uB3C4 \uB2E4\uB4E4 \uC720\uB2A5\uD558\uC2ED\uB2C8\uB2E4\uB9CC, \uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uBB35\uBB35\uD788 \uC790\uAE30 \uC77C\uC744 \uD558\uBA70 \uC911\uB9BD\uC801\uC778 \uC785\uC7A5\uC744 \uCDE8\uD558\uB824\uACE0 \uB178\uB825\uD558\uC2DC\uB294 \uBC95\uB960\uAC00\uB4E4\uC5D0\uAC8C \uC870\uAE08\uC774\uB77C\uB3C4 \uB354 \uC2E0\uB8B0\uAC00 \uAC00\uB294 \uD3B8\uC774\uC5D0\uC694. \uBC95\uB960\uAC00\uC758 \uC911\uB9BD\uC131\uC740 \uC815\uB9D0 \uC911\uC694\uD558\uAC70\uB4E0\uC694.",
