  "text" : "\uC55E\uC73C\uB85C\uB294 \uC5B4\uB5BB\uAC8C \uB420\uC9C0 \uBAA8\uB974\uACA0\uC9C0\uB9CC, \uBC14\uB78C\uC744 \uD53C\uACE0 \uC2F6\uC740 \uC758\uC9C0\uB294 \uAC70\uC758 \uAE4E\uC5EC\uB098\uAC04 \uC0C1\uD0DC. \uD55C\uBC88\uB9CC \uB354 \uBC14\uB78C\uC744 \uD3C8\uB2E4\uAC00\uB294 \uADF8 \uC2A4\uD2B8\uB808\uC2A4\uC5D0 \uBA38\uB9AC\uAC00 \uBE75- \uD558\uACE0 \uD130\uC838\uB098\uAC08\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E4\uB354\uB77C\uACE0. \uC544 \uBB3C\uB860 \uB0B4\uAC00 \uBC14\uB78C\uC758 \uC0C1\uB300(?)\uB77C\uBA74 \uADF8 \uC2A4\uD2B8\uB808\uC2A4\uB294 \uB0B4 \uBAAB\uC774 \uC544\uB2C8\uACA0\uC9C0?",
