    "text" : "\uC0C8\uD574 \uB450 \uBC88\uC9F8 \uB0A0\uC774 \uC800\uBB3C\uC5C8\uC2B5\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC740 \uC5B4\uB5A4 \uC0C8\uD574 \uACC4\uD68D\uC744 \uC138\uC6B0\uC168\uB098\uC694? \uC6B4\uB3D9? \uC5F0\uC560? \uACF5\uBD80? \uCDE8\uC9C1? \uC5C4\uD639\uD55C \uC2DC\uB300\uB77C \uADF8\uB7F0\uC9C0 \uC0AC\uB78C\uB4E4\uC758 \uACC4\uD68D\uC774 \uC810\uCC28 \uC18C\uBC15\uD574\uC838 \uAC11\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC6B0\uB9AC, \uC0C8\uD574 \uACC4\uD68D\uB9CC\uD07C\uC740 \uC7A5\uB300\uD558\uAC8C \uC138\uC6C1\uC2DC\uB2E4. \uC5B4\uCC28\uD53C \uC548 \uC774\uB8E8\uC5B4\uC9C0\uB2C8\uAE4C\uC694.",
