  "text" : "\uC544\uC624 \uC774 \uBE05\uC2E0\uB4E4\uC544, \uB300\uCCB4 \uC65C \uBC31\uC545\uAD00\uC5D0\uB2E4\uAC00 \uB300\uD55C\uBBFC\uAD6D \uB300\uC120 \uC218\uAC1C\uD45C \uCCAD\uC6D0\uC744 \uD558\uB294\uAC70\uC57C? \uB300\uD55C\uBBFC\uAD6D\uC774 \uBB50 \uBBF8\uD569\uC911\uAD6D\uC758 51\uBC88\uC9F8 \uC8FC\uACE0, \uBC15\uADFC\uD61C\uAC00 \uAC70\uAE30 \uC8FC\uC9C0\uC0AC\uC57C?? \uC774 \uC288\u3163\uBC1C, \uC6B0\uB9AC\uB3D9\uB124 \uB208\uB3C4 \uC880 \uCE58\uC6CC\uC8FC\uACE0, \uD3B8\uC758\uC810 \uD638\uBE75\uB3C4 \uBE68\uB9AC \uCC44\uC6CC\uB2EC\uB77C\uACE0 \uBC31\uC545\uAD00\uC5D0\uB2E4\uAC00 \uCCAD\uC6D0\uAE00 \uC62C\uB824\uC57C\uACA0\uB2E4.",
