  "text" : "UN\uC815\uBB34\uAD6D\uC5D0 \uC120\uAC70\uAC10\uC2DC\uB2E8 \uD30C\uACAC \uC694\uCCAD \uB5BC\uBA58\uC158\uC9C8\uC744 \uD588\uB2E4\uAC00 \uBB34\uC2DC\uB2F9\uD558\uACE0\uC120 \"UN\uB3C4 \uC5ED\uC2DC \uAC15\uB300\uAD6D\uC758 \uC774\uC775\uC744 \uB300\uBCC0\uD558\uB294 \uC4F0\uB808\uAE30 \uB2E8\uCCB4\"\uB77C\uACE0 \uB9D0\uD558\uB358 \uC0AC\uB78C\uB4E4\uC774, \uC774\uBC88\uC5D0\uB294 \uBC31\uC545\uAD00\uC5D0 \uCCAD\uC6D0\uC744 \uD558\uACE0 \uC788\uB2E4. \uC5EC\uB7EC\uBD84, \uBC31\uC545\uAD00\uC774\uC544\uB9D0\uB85C \uCD08\uAC15\uB300\uAD6D \uBBF8\uAD6D\uC758 \uC774\uC775\uB9CC\uC744 \uB300\uBCC0\uD558\uB294 \uACF3\uC785\uB2C8\uB2E4.",
